INSERT INTO Translation VALUES('a4b73887-3baa-4207-9052-a5af5b3570d9','Modus Ponens is one of the most fundamental rules of inference in propositional logic, stating that if we have P → Q and P, then we can conclude Q.','מודוס פונס הוא אחד מכללי ההיקש הבסיסיים ביותר בלוגיקה פרופוזיציונלית, הקובע שאם יש לנו P → Q ו-P, אז נוכל להסיק Q.');
INSERT INTO Translation VALUES('3c2b8832-566b-45c2-86f5-2b78fb12c785','Modus Ponens','מודוס פונס');
