INSERT INTO Translation VALUES('7fe02c56-f948-46fe-80ed-98fd1bde42ca','What is the logical form of Modus Tollens?','מה הצורה הלוגית של מודוס טולנס?');
INSERT INTO Translation VALUES('a7ace943-9518-45e8-bdfd-07f10c535fea','Modus Tollens is a valid inference rule that states: from P → Q and ¬Q, we can conclude ¬P. This is the contrapositive form of reasoning.','מודוס טולנס הוא כלל היקש תקין הקובע: מ-P → Q ו-¬Q, נוכל להסיק ¬P. זוהי צורת הטיעון הקונטרה-פוזיטיבית.');
INSERT INTO Translation VALUES('96135d8a-a743-4db7-a029-958f14f2fcd4','P → Q, ¬Q ⊢ ¬P','P → Q, ¬Q ⊢ ¬P');
INSERT INTO Translation VALUES('8b7bcda2-a20f-42dd-95ac-4fdad669b575','P → Q, P ⊢ Q','P → Q, P ⊢ Q');
INSERT INTO Translation VALUES('a9c90a96-4909-4548-859c-31dbc8908775','P ∨ Q, ¬P ⊢ Q','P ∨ Q, ¬P ⊢ Q');
INSERT INTO Translation VALUES('640042dc-f7b5-4a0b-a58a-ca87013a6561','P ∧ Q ⊢ P','P ∧ Q ⊢ P');
INSERT INTO Translation VALUES('f357d264-6a2b-4eb2-af49-4e5fb1de3fde','If we know that "If it rains, then the ground gets wet" and "The ground is not wet", what can we conclude using Modus Tollens?','אם אנו יודעים ש"אם יורד גשם, אז הקרקע נרטבת" ו"הקרקע לא רטובה", מה נוכל להסיק באמצעות מודוס טולנס?');
INSERT INTO Translation VALUES('7a066236-7c5a-4192-a18f-95f06639280e','Modus Tollens allows us to reason from a conditional statement and the negation of its consequent to the negation of its antecedent.','מודוס טולנס מאפשר לנו להסיק מהצהרה מותנית ומשלילת התוצאה שלה לשלילת התנאי שלה.');
INSERT INTO Translation VALUES('82cd3452-be68-4f7d-b932-0cf1564c76de','It is not raining','לא יורד גשם');
INSERT INTO Translation VALUES('6bdb49bb-585e-4d80-9b9f-275e143bc285','It is raining','יורד גשם');
INSERT INTO Translation VALUES('37fe1bd6-1bcd-47c2-9127-2b3b474fdb41','The ground is wet','הקרקע רטובה');
INSERT INTO Translation VALUES('c6da8704-b751-4631-915c-89d76e7957fa','We cannot conclude anything','אינינו יכולים להסיק דבר');
INSERT INTO Translation VALUES('1b38fda5-b3b1-4953-a752-7cb92536cbbb','Which of the following scenarios correctly applies Modus Tollens?','איזה מהתרחישים הבאים מיישם נכון את מודוס טולנס?');
INSERT INTO Translation VALUES('617b1583-49c9-4ef5-a6af-3d7a9a3c578e','This demonstrates the correct application of Modus Tollens: from a conditional and the negation of the consequent, we derive the negation of the antecedent.','זה מדגים את היישום הנכון של מודוס טולנס: מתנאי ושלילת התוצאה, אנו מסיקים את שלילת התנאי.');
INSERT INTO Translation VALUES('109f2b15-ead2-4b5a-a0c8-2fa25f1dfd00','If P then Q; not Q; therefore not P','אם P אז Q; לא Q; לכן לא P');
INSERT INTO Translation VALUES('8473a58a-9b08-40e2-bfef-33af60626ea5','If P then Q; P; therefore Q','אם P אז Q; P; לכן Q');
