INSERT INTO Translation VALUES('f505a3a5-f990-4eb6-92fc-051a4837b260','If P then Q; Q; therefore P','אם P אז Q; Q; לכן P');
INSERT INTO Translation VALUES('b14cfac5-af78-4b04-9f7b-951aaefaf837','What is the truth value of (P ∧ Q) when P is true and Q is false?','מה ערך האמת של (P ∧ Q) כאשר P הוא אמת ו-Q הוא שקר?');
INSERT INTO Translation VALUES('b7f59873-63b2-4d23-bbcd-5ddae158b630','In conjunction (AND), both operands must be true for the result to be true. Since Q is false, P ∧ Q evaluates to false.','בחיבור לוגי (AND), שני הפעילים חייבים להיות אמת כדי שהתוצאה תהיה אמת. מכיוון ש-Q הוא שקר, P ∧ Q מוערך כשקר.');
INSERT INTO Translation VALUES('30dcc07f-e03f-445d-a5eb-a37a60335060','True','אמת');
INSERT INTO Translation VALUES('751d6169-3732-4932-a5e5-84f1a6a57611','False','שקר');
INSERT INTO Translation VALUES('ba01385f-ec64-4255-9b24-c14ae08ccaf7','Undefined','לא מוגדר');
