INSERT INTO Translation VALUES('52a616c8-50e4-43b4-af8c-21781a6c3f48','In which row of the truth table for (P → Q) is the result false?','באיזה שורה בטבלת האמת עבור (P → Q) התוצאה היא שקר?');
INSERT INTO Translation VALUES('60019f4d-8688-4de2-9d52-3c85677ee7a5','Implication P → Q is false only when the antecedent P is true and the consequent Q is false. In all other cases, it is true.','הגרירה P → Q היא שקר רק כאשר התנאי P הוא אמת והתוצאה Q היא שקר. בכל המקרים האחרים, היא אמת.');
