INSERT INTO Translation VALUES('3ac29143-196e-46fd-87fa-2485484f1d64','When P is true and Q is false','כאשר P הוא אמת ו-Q הוא שקר');
INSERT INTO Translation VALUES('f0dce1b9-3f1d-435f-8c5d-41dcb47aa1b1','When P is false and Q is true','כאשר P הוא שקר ו-Q הוא אמת');
INSERT INTO Translation VALUES('459e3498-fe51-4fc1-9f9c-28077d6b05b8','When P is false and Q is false','כאשר P הוא שקר ו-Q הוא שקר');
INSERT INTO Translation VALUES('9ac7d3d0-cc98-4fa6-a45f-f3e9f50b8590','How many rows does a truth table have for a formula with 3 propositional variables?','כמה שורות יש לטבלת אמת עבור נוסחה עם 3 משתנים פרופוזיציונליים?');
INSERT INTO Translation VALUES('ec9fdd84-6dd2-49bb-858c-b8d61269b8fb','A truth table with n propositional variables has 2^n rows, representing all possible combinations of truth values. For 3 variables, this is 2^3 = 8 rows.','טבלת אמת עם n משתנים פרופוזיציונליים יש לה 2^n שורות, המייצגות את כל השילובים האפשריים של ערכי אמת. עבור 3 משתנים, זה 2^3 = 8 שורות.');
INSERT INTO Translation VALUES('b69ae13c-c82d-4a34-a991-32fdabb5eba0','6','6');
