INSERT INTO Translation VALUES('05755023-9c27-464f-9325-57bbcfc864d8','In the Minimax algorithm, what does the maximizing player try to do?','באלגוריתם המינימקס, מה השחקן הממקסם מנסה לעשות?');
INSERT INTO Translation VALUES('0013af9b-c3c3-4126-9a37-1efa770db70a','The maximizing player tries to choose moves that maximize their score, assuming the opponent will play optimally to minimize it.','השחקן הממקסם מנסה לבחור מהלכים שממקסמים את הניקוד שלו, בהנחה שהיריב ישחק באופן אופטימלי כדי למזער אותו.');
INSERT INTO Translation VALUES('74d693d8-1d93-4f11-804a-7974a92e4192','Maximize their own score','למקסם את הניקוד שלהם');
INSERT INTO Translation VALUES('07b6f718-ba00-4c06-9c67-8da0ac3ac071','Minimize their opponents score','למזער את ניקוד היריב');
