INSERT INTO Translation VALUES('7bb236d9-e681-4007-9233-83ee1de9c67a','What is the definition of convergence to infinity for a sequence?','מהי הגדרת ההתכנסות לאינסוף של סדרה?');
INSERT INTO Translation VALUES('c31c3d74-14eb-456a-bb21-02ff368d4455','A sequence {an} converges to infinity if for every positive real number M, there exists a positive integer N such that for all n ≥ N, an > M.','סדרה {an} מתכנסת לאינסוף אם לכל מספר ממשי חיובי M, קיים מספר שלם חיובי N כך שלכל n ≥ N, an > M.');
