INSERT INTO Translation VALUES('d5e863c7-cff4-4bf6-a557-4850f66b6def','Points where the function is undefined','נקודות שבהן הפונקציה לא מוגדרת');
INSERT INTO Translation VALUES('6cae6aaf-21a1-45bf-b0b3-d1227628f666','The maximum and minimum values of the function','הערכים המקסימליים והמינימליים של הפונקציה');
INSERT INTO Translation VALUES('c414d419-968f-49ba-9370-d735cf0131e0','The domain of the function','התחום של הפונקציה');
INSERT INTO Translation VALUES('bf19eebd-d6de-4571-8223-4e5766015543','What steps are involved in full function analysis?','אלו שלבים כרוכים בניתוח מלא של פונקציה?');
