INSERT INTO Translation VALUES('6e9604c7-cab4-4af8-87fa-b4e047c1a4b1','Only look at endpoints','רק מסתכלים על קצוות');
INSERT INTO Translation VALUES('e3e12506-56b3-4ae4-ab92-c24aad4c25cd','Use L''Hôpital''s rule','משתמשים בכלל לופיטל');
INSERT INTO Translation VALUES('d06e4016-0a2b-4b9a-9a63-3ecbb4027ca8','What is L''Hôpital''s rule used for?','בשביל מה משתמשים בכלל לופיטל?');
INSERT INTO Translation VALUES('aeabf52b-7f56-43ce-96ab-f9bcfd3e7bb8','Evaluating limits of indeterminate forms like 0/0 or ∞/∞','חישוב גבולות של צורות לא-מוגדרות כמו 0/0 או ∞/∞');
