INSERT INTO Translation VALUES('12cbe27d-eed6-4738-96e8-177cb3aec851','If y = f^(-1)(x), then dy/dx = 1/(df/dy)','אם y = f^(-1)(x), אז dy/dx = 1/(df/dy)');
