INSERT INTO Translation VALUES('1cb8a174-2650-4704-aa23-fc652ce58183','Apply LHopitals rule','ליישם את כלל לופיטל');
INSERT INTO Translation VALUES('22438cfa-4c42-464f-9019-c39cd124748b','What is the relationship between a function and its inverse regarding differentiation?','מה הקשר בין פונקציה לפונקציה ההפוכה שלה בנוגע לגזירה?');
INSERT INTO Translation VALUES('7f4ae295-d3db-4a59-aa13-d493b449dc9c','The derivative of the inverse equals the reciprocal of the derivative','הנגזרת של ההפוכה שווה להופכי של הנגזרת');
INSERT INTO Translation VALUES('a48a68eb-6775-4cbe-a10c-7677fd4f4767','They have the same derivative','יש להן אותה נגזרת');
INSERT INTO Translation VALUES('58176d0a-3646-4772-a4ba-30fda8dfb2ca','The derivatives are negatives of each other','הנגזרות הן שליליות זו של זו');
