INSERT INTO Translation VALUES('168fc231-a242-46e7-9ab7-ee42247dff60','If f(x) = x^3, what is the derivative of f^(-1)(x)?','אם f(x) = x^3, מה הנגזרת של f^(-1)(x)?');
