INSERT INTO Translation VALUES('41349507-df2a-419a-999c-d824ea7e4af7','1/3 * x^(-2/3)','1/3 * x^(-2/3)');
INSERT INTO Translation VALUES('6a925f74-dbb8-4cfc-8e3f-63bfaa44617d','Which condition must be satisfied for a function to have a differentiable inverse?','איזה תנאי חייב להתקיים כדי שלפונקציה תהיה פונקציה הפוכה גזירה?');
INSERT INTO Translation VALUES('0efb3c56-b4f0-4cff-8c0e-3bd5c40d2a33','The function must be one-to-one and onto','הפונקציה חייבת להיות חד-חד-ערכית ועל');
INSERT INTO Translation VALUES('c8efc274-f67f-4b36-bc20-8ea027dfa560','The derivative must never equal zero','הנגזרת לא יכולה להיות שווה לאפס');
