INSERT INTO Translation VALUES('88be8af2-f771-45b3-a9e3-1a0fc1c7a299','The function must be linear','הפונקציה חייבת להיות לינארית');
INSERT INTO Translation VALUES('b0f9b698-bd0d-412c-8622-69dbf9a6cb48','What is the derivative of arcsin(x)?','מה הנגזרת של arcsin(x)?');
INSERT INTO Translation VALUES('7ba5d1b9-fa03-4010-9008-c48cedc77a1d','The derivative of arccos(x) is positive for all x in its domain','הנגזרת של arccos(x) חיובית לכל x בתחום ההגדרה שלה');
