INSERT INTO Translation VALUES('6cca70b9-65ef-46fe-b56d-cdeb6c4020b9','What is the primary purpose of logarithmic differentiation?','מה המטרה העיקרית של גזירה לוגריתמית?');
INSERT INTO Translation VALUES('aeda1297-ffa7-4208-bad0-b85ad3515bcc','To simplify differentiation of complex expressions','לפשט גזירה של ביטויים מורכבים');
INSERT INTO Translation VALUES('f463ddfd-a7ae-4f0f-9be6-5ffc96b8b546','To find products and quotients more easily','למצוא מכפלות ומנות בקלות רבה יותר');
INSERT INTO Translation VALUES('5e126f6e-8d52-4ac1-8a0c-e288ffc4d434','To integrate functions','לאנטגרל פונקציות');
