INSERT INTO Translation VALUES('159cb7e7-5700-4d0f-8836-e3eb362a62be','Products of many functions','מכפלות של פונקציות רבות');
INSERT INTO Translation VALUES('769e49e8-6bff-44fb-b301-3c48da733b01','Linear functions','פונקציות לינאריות');
INSERT INTO Translation VALUES('e6a4ed96-478d-41f8-9fbc-3bf6cf6aaa03','Constant functions','פונקציות קבועות');
INSERT INTO Translation VALUES('d97b52e7-9e15-496a-9c78-4e5cb8600d0f','If y = x^x, what is dy/dx using logarithmic differentiation?','אם y = x^x, מה dy/dx באמצעות גזירה לוגריתמית?');
