INSERT INTO Translation VALUES('888131fa-6521-4031-b4a3-e4f048f27e28','x^x * ln(x)','x^x * ln(x)');
INSERT INTO Translation VALUES('e4919ed3-95ca-4213-b7ac-0f7776c31b38','x^x','x^x');
INSERT INTO Translation VALUES('f1c2e19c-0d22-4017-a61d-69729c65fdcb','What is the first step in logarithmic differentiation?','מה השלב הראשון בגזירה לוגריתמית?');
INSERT INTO Translation VALUES('b752f230-60ab-45d6-9c90-e49745553b4f','Take the natural logarithm of both sides','לקחת את הלוגריתם הטבעי של שני הצדדים');
