INSERT INTO Translation VALUES('a9f99efb-afc5-4fad-82ec-f0c5f7939208','When using logarithmic differentiation for y = (x^2 + 1)^3 * sqrt(x-1), what do you get after taking ln of both sides?','כאשר משתמשים בגזירה לוגריתמית עבור y = (x^2 + 1)^3 * sqrt(x-1), מה מקבלים אחרי לקיחת ln של שני הצדדים?');
INSERT INTO Translation VALUES('4d53c116-db4b-49df-92fd-a4e23e7f96f7','ln(y) = 3ln(x^2 + 1) + 1/2 * ln(x-1)','ln(y) = 3ln(x^2 + 1) + 1/2 * ln(x-1)');
INSERT INTO Translation VALUES('d99f104f-df9d-4687-9dd0-069568b95e0b','ln(y) = 3(x^2 + 1) + sqrt(x-1)','ln(y) = 3(x^2 + 1) + sqrt(x-1)');
INSERT INTO Translation VALUES('14d7f4ae-84d5-4510-93bb-0663e72fb200','ln(y) = ln(3(x^2 + 1)) + ln(sqrt(x-1))','ln(y) = ln(3(x^2 + 1)) + ln(sqrt(x-1))');
INSERT INTO Translation VALUES('d4afec00-b2c0-443f-a58a-376ea85c2c40','ln(y) = 3x^2 + 3 + x - 1','ln(y) = 3x^2 + 3 + x - 1');
INSERT INTO Translation VALUES('e7046c33-3dbf-45e4-8793-b07decf58a0e','The logarithm of a product equals the sum of logarithms','הלוגריתם של מכפלה שווה לסכום הלוגריתמים');
INSERT INTO Translation VALUES('12f12bb7-559c-44b8-8c91-a82a43d45de8','What is the derivative of ln(x) with respect to x?','מה הנגזרת של ln(x) ביחס ל-x?');
