INSERT INTO Translation VALUES('9e8932a0-45fa-41ce-90fc-f517d6ac5ecc','x','x');
INSERT INTO Translation VALUES('b7056a16-9d10-4c70-bbde-60e6115f1da4','ln(x)','ln(x)');
