INSERT INTO Translation VALUES('33fff78d-5afb-418b-92fc-23b1c3b50bf4','State the Mean Value Theorem for derivatives','נסחו את משפט הערך הממוצע לנגזרות');
INSERT INTO Translation VALUES('c1fedd3f-d5fd-4f4a-aede-f33d3ba26a10','What are the conditions required for the Mean Value Theorem to apply?','מהם התנאים הנדרשים כדי שמשפט הערך הממוצע יחול?');
INSERT INTO Translation VALUES('a4f4bddf-989b-4d41-9b1b-cf3cc9d20e82','Function must be continuous on [a,b] and differentiable on (a,b)','הפונקציה חייבת להיות רציפה על [a,b] וגזירה על (a,b)');
INSERT INTO Translation VALUES('a7666bf9-17bc-49f6-b483-3175f1bf9ef6','Function must be increasing','הפונקציה חייבת להיות עולה');
INSERT INTO Translation VALUES('10798bbb-f254-4b5a-b011-68f09d29bf7f','Function must be polynomial','הפונקציה חייבת להיות פולינום');
INSERT INTO Translation VALUES('0d537fef-53c7-4f8b-8df6-0854b6b8d727','Function must be bounded','הפונקציה חייבת להיות חסומה');
INSERT INTO Translation VALUES('46716826-497d-4936-afd1-f8354c387cd5','According to the Mean Value Theorem, if f is continuous on [0,3] and differentiable on (0,3), what can we conclude?','על פי משפט הערך הממוצע, אם f רציפה על [0,3] וגזירה על (0,3), מה נוכל להסיק?');
INSERT INTO Translation VALUES('2a5429e4-9527-4368-9f5f-41f0343cd7ca','There exists c in (0,3) such that f''(c) = (f(3)-f(0))/3','קיים c ב-(0,3) כך ש-f''(c) = (f(3)-f(0))/3');
INSERT INTO Translation VALUES('1606dccf-c4d9-4439-a8f9-a0f79aea6466','f(x) is constant on [0,3]','f(x) קבועה על [0,3]');
INSERT INTO Translation VALUES('4d0cdaaa-1a10-444d-9f64-99b7920e11fc','f(x) has a maximum at x=1.5','לf(x) יש מקסימום ב-x=1.5');
INSERT INTO Translation VALUES('59248e52-6ec2-4468-9abd-f1c0524c23ec','f(x) is linear','f(x) לינארית');
INSERT INTO Translation VALUES('64561eb8-e382-4671-ad92-d96644bd5a17','What does the Mean Value Theorem geometrically represent?','מה משפט הערך הממוצע מייצג גיאומטרית?');
INSERT INTO Translation VALUES('9d9976bf-897d-471a-9722-d7e57316bcef','There is a point where the tangent line is parallel to the secant line','יש נקודה שבה הישר המשיק מקביל לישר החותך');
INSERT INTO Translation VALUES('057f672b-6ee1-4e86-87cb-0f5f19abcc04','The function has a horizontal tangent','לפונקציה יש משיק אופקי');
INSERT INTO Translation VALUES('48f0c232-2198-4853-8375-f3670ea32f70','The function crosses the x-axis','הפונקציה חוצה את ציר ה-x');
INSERT INTO Translation VALUES('cbaa9594-af4e-430a-9d01-adb3aa835e7d','The function has a vertical asymptote','לפונקציה יש אסימפטוטה אנכית');
INSERT INTO Translation VALUES('6df0bbda-5746-4d45-a212-100a61e4b990','If f(x) = x^2 on [1,4], what is the value of c guaranteed by the Mean Value Theorem?','אם f(x) = x^2 על [1,4], מה הערך של c שמובטח על ידי משפט הערך הממוצע?');
