INSERT INTO Translation VALUES('6452fcfa-cf9c-4f8e-88f5-9baf6e3de7e0','Can the Mean Value Theorem be applied to f(x) = |x| on [-1,1]? Explain why or why not.','האם ניתן ליישם את משפט הערך הממוצע על f(x) = |x| על [-1,1]? הסבירו מדוע כן או לא.');
INSERT INTO Translation VALUES('3cd2b200-2359-4ce0-94d5-4f4bce1726ba','What is an absolute maximum of a function?','מה זה מקסימום מוחלט של פונקציה?');
INSERT INTO Translation VALUES('ff646c7d-384b-42e0-8a09-2953eb1a0d10','The largest value the function attains on its entire domain','הערך הגדול ביותר שהפונקציה מקבלת על כל התחום שלה');
INSERT INTO Translation VALUES('4cdc0596-a0a6-4bf8-8636-9c9131afc7c9','A point where the derivative is zero','נקודה שבה הנגזרת שווה לאפס');
