INSERT INTO Translation VALUES('bbda9527-337a-4878-a380-1b8281f043f5','For a continuous function on a closed interval, what guarantees the existence of absolute extrema?','עבור פונקציה רציפה על קטע סגור, מה מבטיח את קיומם של קיצון מוחלטים?');
INSERT INTO Translation VALUES('3102df24-393d-4844-8cf1-5660f73f9eae','The Extreme Value Theorem','משפט הערכים הקיצוניים');
INSERT INTO Translation VALUES('5542c33a-2964-41f4-a633-3a1612c156d4','The Intermediate Value Theorem','משפט הערך הביניים');
INSERT INTO Translation VALUES('132f5f15-795b-4d38-b9f2-a04d008a0bda','The Mean Value Theorem','משפט הערך הממוצע');
INSERT INTO Translation VALUES('5b770cbf-85f5-4b6b-bcb5-84d5c958b390','Rolle''s Theorem','משפט רול');
INSERT INTO Translation VALUES('726ee07c-c620-43e6-a673-04cfadea42b0','Where can absolute extrema occur for a continuous function on a closed interval?','איפה יכולים להתרחש קיצון מוחלטים עבור פונקציה רציפה על קטע סגור?');
INSERT INTO Translation VALUES('e5d37f89-2f8e-45ff-90ee-7f103908994f','At critical points or endpoints of the interval','בנקודות קריטיות או בקצוות הקטע');
