INSERT INTO Translation VALUES('056b8409-3f4e-487d-babf-01a5f84333d2','Anywhere on the interval','בכל מקום על הקטע');
INSERT INTO Translation VALUES('d0a4f886-c8cb-4fb2-b5c3-8f55f502842f','What is the difference between local and absolute extrema?','מה ההבדל בין קיצון מקומיים לקיצון מוחלטים?');
