INSERT INTO Translation VALUES('d68d370d-2686-4d3e-a56e-c3637dba830c','To determine whether critical points are local maxima or minima','לקבוע אם נקודות קריטיות הן מקסימום או מינימום מקומיים');
INSERT INTO Translation VALUES('7d534cde-4b51-451e-b8f4-a722a8da57b7','To find the derivative of a function','למצוא את הנגזרת של פונקציה');
INSERT INTO Translation VALUES('56a0574e-bfe4-4b00-ad2a-7942ca9ef2d9','To solve differential equations','לפתור משוואות דיפרנציאליות');
INSERT INTO Translation VALUES('fe790131-c078-4213-81f5-c4e555cbb320','To find inflection points','למצוא נקודות פיתול');
