INSERT INTO Translation VALUES('2c4799d7-47ff-4d68-a0fa-d4a3a355ee76','x = c is undefined','x = c לא מוגדר');
INSERT INTO Translation VALUES('a7acfbab-311f-48bb-b73f-98a25981cca5','A function is convex when its second derivative is positive','פונקציה קמורה כאשר הנגזרת השנייה שלה חיובית');
INSERT INTO Translation VALUES('a23c27f3-b134-4b6a-8e37-f781d7d369bc','What characterizes a convex function graphically?','מה מאפיין פונקציה קמורה בצורה גרפית?');
INSERT INTO Translation VALUES('0cdde218-e2b3-4796-b533-64930b1f1470','The graph curves upward like a cup','הגרף מתעקם כלפי מעלה כמו כוס');
