INSERT INTO Translation VALUES('e86b8a38-f08f-4c25-b883-13c0e9057fe6','Function continuous on [a,b], differentiable on (a,b), f(a) = f(b)','פונקציה רציפה על [a,b], גזירה על (a,b), f(a) = f(b)');
