INSERT INTO Translation VALUES('trans_q31','State the basic limit theorems for arithmetic operations.','הצג את משפטי הגבול הבסיסיים לפעולות אריתמטיות.');
INSERT INTO Translation VALUES('trans_q32','Explain the limit theorem for composite functions.','הסבר את משפט הגבול לפונקציות מורכבות.');
INSERT INTO Translation VALUES('trans_q33','What is LHopitals rule and when can it be applied?','מהו כלל לופיטל ומתי ניתן ליישם אותו?');
INSERT INTO Translation VALUES('trans_q34','Evaluate lim(x→0) (sin x)/x.','חשב lim(x→0) (sin x)/x.');
INSERT INTO Translation VALUES('trans_q35','How do you find limits involving indeterminate forms?','איך מוצאים גבולות הכוללים צורות לא מוגדרות?');
INSERT INTO Translation VALUES('trans_q36','Explain the squeeze theorem with an example.','הסבר את משפט הסנדויץ עם דוגמה.');
INSERT INTO Translation VALUES('trans_q37','What are the standard limits involving trigonometric functions?','מהם הגבולות הסטנדרטיים הכוללים פונקציות טריגונומטריות?');
INSERT INTO Translation VALUES('trans_q38','Evaluate lim(x→∞) (1 + 1/x)^x.','חשב lim(x→∞) (1 + 1/x)^x.');
INSERT INTO Translation VALUES('trans_q39','How do you handle limits of rational functions at infinity?','איך מטפלים בגבולות של פונקציות רציונליות באינסוף?');
INSERT INTO Translation VALUES('trans_q40','Explain the relationship between limits and continuity.','הסבר את הקשר בין גבולות ורציפות.');
INSERT INTO Translation VALUES('trans_q41','Define what it means for lim(x→a) f(x) = +∞.','הגדר מה זה אומר ש-lim(x→a) f(x) = +∞.');
INSERT INTO Translation VALUES('trans_q42','Explain the concept of limits at infinity.','הסבר את המושג של גבולות באינסוף.');
INSERT INTO Translation VALUES('trans_q43','What is a horizontal asymptote?','מהי אסימפטוטה אופקית?');
INSERT INTO Translation VALUES('trans_q44','How do you find vertical asymptotes of a function?','איך מוצאים אסימפטוטות אנכיות של פונקציה?');
INSERT INTO Translation VALUES('trans_q45','Evaluate lim(x→∞) (3x² - 2x + 1)/(x² + 5x - 7).','חשב lim(x→∞) (3x² - 2x + 1)/(x² + 5x - 7).');
INSERT INTO Translation VALUES('trans_q46','What is an oblique (slant) asymptote?','מהי אסימפטוטה אלכסונית?');
INSERT INTO Translation VALUES('trans_q47','Explain infinite limits versus limits at infinity.','הסבר גבולות אינסופיים לעומת גבולות באינסוף.');
INSERT INTO Translation VALUES('trans_q48','How do you determine the end behavior of polynomial functions?','איך קובעים את ההתנהגות הסופית של פונקציות פולינומיות?');
INSERT INTO Translation VALUES('trans_q49','Find all asymptotes of f(x) = (2x² - 3x + 1)/(x - 1).','מצא את כל האסימפטוטות של f(x) = (2x² - 3x + 1)/(x - 1).');
INSERT INTO Translation VALUES('trans_q50','Explain the relationship between infinite limits and discontinuities.','הסבר את הקשר בין גבולות אינסופיים ואי-רציפויות.');
INSERT INTO Translation VALUES('trans_q51','Define what it means for a sequence to be bounded.','הגדר מה זה אומר שסדרה חסומה.');
INSERT INTO Translation VALUES('trans_q52','Prove that every convergent sequence is bounded.','הוכח שכל סדרה מתכנסת היא חסומה.');
INSERT INTO Translation VALUES('trans_q53','State the Bolzano-Weierstrass theorem.','הצג את משפט בולצנו-ויירשטראס.');
INSERT INTO Translation VALUES('trans_q54','Give an example of a bounded sequence that does not converge.','תן דוגמה לסדרה חסומה שלא מתכנסת.');
INSERT INTO Translation VALUES('trans_q55','Explain the relationship between boundedness and convergence.','הסבר את הקשר בין חסימות והתכנסות.');
INSERT INTO Translation VALUES('trans_q56','What is the supremum of a bounded sequence?','מהו הסופרמום של סדרה חסומה?');
INSERT INTO Translation VALUES('trans_q57','Prove that a monotone bounded sequence converges.','הוכח שסדרה מונוטונית חסומה מתכנסת.');
INSERT INTO Translation VALUES('trans_q58','Define upper and lower bounds of a sequence.','הגדר חסמים עליונים ותחתונים של סדרה.');
INSERT INTO Translation VALUES('trans_q59','What is the limit superior and limit inferior of a sequence?','מהם הגבול העליון והגבול התחתון של סדרה?');
INSERT INTO Translation VALUES('trans_q60','Explain how boundedness relates to subsequences.','הסבר איך חסימות קשורה לתת-סדרות.');
INSERT INTO Translation VALUES('trans_q61','If aₙ ≤ bₙ for all n and both sequences converge, what can you say about their limits?','אם aₙ ≤ bₙ לכל n ושתי הסדרות מתכנסות, מה ניתן לומר על הגבולות שלהן?');
INSERT INTO Translation VALUES('trans_q62','State and prove the comparison test for sequence convergence.','הצג והוכח את מבחן ההשוואה להתכנסות סדרות.');
INSERT INTO Translation VALUES('trans_q63','Explain how to use inequalities to prove sequence convergence.','הסבר איך להשתמש באי-שוויונים כדי להוכיח התכנסות סדרות.');
INSERT INTO Translation VALUES('trans_q64','What is the relationship between sequence inequalities and limit preservation?','מה הקשר בין אי-שוויונים של סדרות ושמירה על גבולות?');
INSERT INTO Translation VALUES('trans_q65','Give an example where aₙ < bₙ but lim aₙ = lim bₙ.','תן דוגמה בה aₙ < bₙ אבל lim aₙ = lim bₙ.');
INSERT INTO Translation VALUES('trans_q66','How do you prove that 0 ≤ aₙ ≤ M implies {aₙ} is bounded?','איך מוכיחים ש-0 ≤ aₙ ≤ M גורר ש-{aₙ} חסומה?');
INSERT INTO Translation VALUES('trans_q67','Explain the sandwich theorem for sequences.','הסבר את משפט הסנדויץ לסדרות.');
INSERT INTO Translation VALUES('trans_q68','What happens to inequalities when taking limits of sequences?','מה קורה לאי-שוויונים כאשר לוקחים גבולות של סדרות?');
INSERT INTO Translation VALUES('trans_q69','Prove that if aₙ ≤ L for all n and aₙ → A, then A ≤ L.','הוכח שאם aₙ ≤ L לכל n ו-aₙ → A, אז A ≤ L.');
INSERT INTO Translation VALUES('trans_q70','How do you use inequalities to establish bounds on sequence terms?','איך משתמשים באי-שוויונים כדי לקבוע חסמים על איברי סדרה?');
INSERT INTO Translation VALUES('trans_q71','State the squeeze theorem for sequences.','הצג את משפט הסנדויץ לסדרות.');
INSERT INTO Translation VALUES('trans_q72','Give an example of using the squeeze theorem to find a limit.','תן דוגמה לשימוש במשפט הסנדויץ למציאת גבול.');
INSERT INTO Translation VALUES('trans_q73','How do you apply the squeeze theorem to trigonometric limits?','איך מיישמים את משפט הסנדויץ לגבולות טריגונומטריים?');
INSERT INTO Translation VALUES('trans_q74','Prove that lim(n→∞) sin(n)/n = 0 using the squeeze theorem.','הוכח ש-lim(n→∞) sin(n)/n = 0 באמצעות משפט הסנדויץ.');
INSERT INTO Translation VALUES('ans_q1','An extremum of a function is a point where the function reaches either a maximum or minimum value. A maximum point is where the function value is greater than or equal to all nearby points, while a minimum point is where the function value is less than or equal to all nearby points.','קיצון של פונקציה הוא נקודה בה הפונקציה מגיעה לערך מקסימלי או מינימלי. נקודת מקסימום היא בה ערך הפונקציה גדול או שווה לכל הנקודות הסמוכות, בעוד נקודת מינימום היא בה ערך הפונקציה קטן או שווה לכל הנקודות הסמוכות.');
INSERT INTO Translation VALUES('ans_q2','A local extremum is a point where the function reaches a maximum or minimum value compared to nearby points in a small neighborhood. A global extremum is a point where the function reaches the absolute maximum or minimum value over its entire domain.','קיצון מקומי הוא נקודה בה הפונקציה מגיעה לערך מקסימלי או מינימלי ביחס לנקודות סמוכות בסביבה קטנה. קיצון גלובלי הוא נקודה בה הפונקציה מגיעה לערך המקסימלי או המינימלי המוחלט על כל התחום שלה.');
INSERT INTO Translation VALUES('ans_q3','Fermats theorem states that if f(x) has a local extremum at x = c and f is differentiable at c, then f''(c) = 0. This means critical points (where the derivative is zero) are candidates for local extrema.','משפט פרמה קובע שאם לf(x) יש קיצון מקומי ב-x = c ו-f גזירה ב-c, אז f''(c) = 0. זה אומר שנקודות קריטיות (בהן הנגזרת היא אפס) הן מועמדות לקיצונים מקומיים.');
INSERT INTO Translation VALUES('ans_q4','To find critical points of a differentiable function f(x): 1) Find f''(x), 2) Solve f''(x) = 0 for all values of x, 3) Also check points where f''(x) is undefined but f(x) is defined.','כדי למצוא נקודות קריטיות של פונקציה גזירה f(x): 1) מצא את f''(x), 2) פתור f''(x) = 0 לכל ערכי x, 3) בדוק גם נקודות בהן f''(x) לא מוגדרת אבל f(x) מוגדרת.');
INSERT INTO Translation VALUES('ans_q5','The second derivative test: If f''(c) = 0 and f''''(c) > 0, then c is a local minimum. If f''(c) = 0 and f''''(c) < 0, then c is a local maximum. If f''''(c) = 0, the test is inconclusive.','מבחן הנגזרת השנייה: אם f''(c) = 0 ו-f''''(c) > 0, אז c הוא מינימום מקומי. אם f''(c) = 0 ו-f''''(c) < 0, אז c הוא מקסימום מקומי. אם f''''(c) = 0, המבחן אינו חד-משמעי.');
INSERT INTO Translation VALUES('fc684f26-2cfd-4a9c-9fc0-91e848d6add2','What is the definition of a monotone increasing sequence?','מה ההגדרה של סדרה מונוטונית עולה?');
INSERT INTO Translation VALUES('5fc77e2d-bdbf-4cbc-b778-18f3b08a3957','A sequence where each term is greater than or equal to the previous term','סדרה בה כל איבר גדול או שווה מהאיבר הקודם');
INSERT INTO Translation VALUES('934374a3-19a4-470a-9783-06c6e4e77b43','A sequence where each term is strictly less than the previous term','סדרה בה כל איבר קטן בממש מהאיבר הקודם');
INSERT INTO Translation VALUES('1990dba3-0ac7-4188-a319-d622a812c095','A sequence that converges to infinity','סדרה המתכנסת לאינסוף');
INSERT INTO Translation VALUES('f529567d-8957-4cce-898c-a3eacf05ab08','A sequence with constant terms','סדרה עם איברים קבועים');
INSERT INTO Translation VALUES('422334c4-aad4-4a20-8608-7c60f8ce3571','If {aₙ} is a bounded monotone increasing sequence, what can we conclude?','אם {aₙ} היא סדרה מונוטונית עולה וחסומה, מה אנחנו יכולים להסיק?');
INSERT INTO Translation VALUES('e074ae87-2984-4003-8c96-8ab30d775a02','The sequence converges to its supremum','הסדרה מתכנסת לסופרמום שלה');
INSERT INTO Translation VALUES('5c042780-e5f2-4f6b-b322-ad5a4b2283fa','The sequence diverges to infinity','הסדרה מתבדרת לאינסוף');
INSERT INTO Translation VALUES('785cb6db-0beb-4061-9dce-4f1a412e8cea','The sequence oscillates','הסדרה מתנדדת');
INSERT INTO Translation VALUES('e8f1eddc-2b63-4fca-a7ba-47c50e141869','The sequence has no limit','לסדרה אין גבול');
INSERT INTO Translation VALUES('c4e6cb71-fb70-4590-8b24-df6452258914','Is the sequence aₙ = 1 + 1/n monotone?','האם הסדרה aₙ = 1 + 1/n מונוטונית?');
INSERT INTO Translation VALUES('49164988-c566-4210-8081-85d78dc72bbf','What is the supremum of the sequence aₙ = 1 - 1/n for n ≥ 1?','מה הסופרמום של הסדרה aₙ = 1 - 1/n עבור n ≥ 1?');
INSERT INTO Translation VALUES('d649ad6e-d4d8-42c4-983c-087c671df730','What is a subsequence?','מה היא תת-סדרה?');
INSERT INTO Translation VALUES('261856cc-0a6a-4651-822b-30a131360e72','A sequence formed by selecting terms from the original sequence while preserving their order','סדרה הנוצרת על ידי בחירת איברים מהסדרה המקורית תוך שמירה על הסדר');
INSERT INTO Translation VALUES('4def2c78-122a-4fce-a12b-fbfa03873714','A sequence obtained by rearranging terms randomly','סדרה שמתקבלת על ידי סידור איברים באופן אקראי');
INSERT INTO Translation VALUES('48449d0a-9c49-4ce2-9ad9-d6f831996405','A sequence with fewer terms than the original','סדרה עם פחות איברים מהמקורית');
INSERT INTO Translation VALUES('823e2b11-cca1-4264-82cb-78cd13bebf83','The inverse of the original sequence','ההופכי של הסדרה המקורית');
INSERT INTO Translation VALUES('e64958f3-dc3e-4554-9126-7bd331336246','If a sequence has a convergent subsequence, what can we say about the original sequence?','אם לסדרה יש תת-סדרה מתכנסת, מה אנחנו יכולים לומר על הסדרה המקורית?');
INSERT INTO Translation VALUES('aa526c71-5fe5-4e9e-a6fe-6bdf38d43bb4','The original sequence may or may not converge','הסדרה המקורית יכולה להתכנס או לא להתכנס');
INSERT INTO Translation VALUES('4003d3ab-d66b-4be5-bfe1-70e238cb3e9e','The original sequence must also converge','הסדרה המקורית חייבת גם כן להתכנס');
INSERT INTO Translation VALUES('c3ee463a-956f-437d-a182-7932b7b8ce40','The original sequence cannot converge','הסדרה המקורית לא יכולה להתכנס');
INSERT INTO Translation VALUES('5919186c-beba-4458-843a-0973cf537944','All subsequences must converge to the same limit','כל התת-סדרות חייבות להתכנס לאותו גבול');
INSERT INTO Translation VALUES('d5c4bad1-6148-44a3-b531-6173ef07324b','Does every bounded sequence have a convergent subsequence?','האם לכל סדרה חסומה יש תת-סדרה מתכנסת?');
INSERT INTO Translation VALUES('45690ced-8a35-4a5e-8022-8c50c1586cd6','What is the Bolzano-Weierstrass theorem primarily concerned with?','במה עוסק בעיקר המשפט של בולצנו-ויירשטראס?');
INSERT INTO Translation VALUES('6af2a799-5f65-4925-9a2e-a7153ba055d7','Every bounded sequence has a convergent subsequence','לכל סדרה חסומה יש תת-סדרה מתכנסת');
INSERT INTO Translation VALUES('a7994f4b-2944-4449-b85e-cd633ee3b55b','Every sequence converges','כל סדרה מתכנסת');
INSERT INTO Translation VALUES('d9e7b963-4a17-4e1b-b35c-30f1cd37e6a6','Only monotone sequences converge','רק סדרות מונוטוניות מתכנסות');
INSERT INTO Translation VALUES('a57c9827-2863-443a-8491-6beea2491e16','Unbounded sequences always diverge','סדרות לא חסומות תמיד מתבדרות');
INSERT INTO Translation VALUES('05643a81-816b-49f3-84ec-a2416454d304','If {aₙ} is a Cauchy sequence, what property does it have?','אם {aₙ} היא סדרת קושי, איזה תכונה יש לה?');
INSERT INTO Translation VALUES('2589e6c2-a06d-40ac-8311-92bb2ad593fe','For any ε > 0, there exists N such that |aₘ - aₙ| < ε for all m,n > N','לכל ε > 0, קיים N כך ש |aₘ - aₙ| < ε לכל m,n > N');
INSERT INTO Translation VALUES('a074175e-cf7c-4fdc-8471-5e7448ddf269','It is always bounded above','היא תמיד חסומה מלמעלה');
INSERT INTO Translation VALUES('c820723f-d67b-4dc4-ac2b-a7f1c16ec2b6','It has infinitely many limit points','יש לה אינסוף נקודות צבירה');
INSERT INTO Translation VALUES('6f0cdab5-00e2-4529-a2b1-c74dfd707ff1','All its terms are positive','כל האיברים שלה חיוביים');
INSERT INTO Translation VALUES('f8efa76c-d396-4e22-bc47-4ad3ddef5b27','What is an infinite series?','מה היא טור אינסופי?');
INSERT INTO Translation VALUES('b731eb1a-5887-47ea-babc-4bd31cb9e637','The sum of infinitely many terms of a sequence','סכום של אינסוף איברים של סדרה');
INSERT INTO Translation VALUES('5a3b59b8-ead9-422c-99a0-e0a2abdc2175','A sequence with infinite terms','סדרה עם איברים אינסופיים');
INSERT INTO Translation VALUES('a6f16eb0-0152-41d5-82cc-a12c081e3266','A function defined on infinite intervals','פונקציה המוגדרת על קטעים אינסופיים');
INSERT INTO Translation VALUES('cf278f8e-f08c-416a-b418-be585f19be0c','A limit that approaches infinity','גבול שמתקרב לאינסוף');
INSERT INTO Translation VALUES('7f05e47f-681f-4089-a157-52ecc27bb086','What is the nth partial sum of the series Σ(1/2ⁿ)?','מה הוא הסכום החלקי ה-n של הטור Σ(1/2ⁿ)?');
INSERT INTO Translation VALUES('c4a2feba-0456-4b5d-8427-e5b119f9f5fd','1 - (1/2)ⁿ⁺¹','1 - (1/2)ⁿ⁺¹');
INSERT INTO Translation VALUES('ca10639b-1f6b-4528-85c5-29aa80a95d4f','n/2ⁿ','n/2ⁿ');
INSERT INTO Translation VALUES('09d93e80-79bd-4a11-af89-92b36c20d956','2ⁿ - 1','2ⁿ - 1');
INSERT INTO Translation VALUES('dfabfef4-220e-478e-8581-8e8bd76fc566','(1/2)ⁿ','(1/2)ⁿ');
INSERT INTO Translation VALUES('fccab104-10dc-4164-9834-16238eea8fbb','Does the series Σ(1/n) converge?','האם הטור Σ(1/n) מתכנס?');
INSERT INTO Translation VALUES('028ccc3b-2487-4e03-aa8c-be4e27188cdb','What condition must be satisfied for the integral test to apply to a series Σaₙ?','איזה תנאי חייב להתקיים כדי שמבחן האינטגרל יחול על הטור Σaₙ?');
INSERT INTO Translation VALUES('ae2a8d85-0249-42f8-90df-e27a90e934e7','The terms must be positive, decreasing, and there exists a continuous function f(x) ≥ 0 such that f(n) = aₙ','האיברים חייבים להיות חיוביים, יורדים, וקיימת פונקציה רציפה f(x) ≥ 0 כך ש f(n) = aₙ');
INSERT INTO Translation VALUES('082acdbd-3690-4aff-94f6-54be887e5bcc','The terms must be bounded','האיברים חייבים להיות חסומים');
INSERT INTO Translation VALUES('22581d8d-8732-4e38-b177-bd714dff5acc','The series must have finitely many terms','הטור חייב להיות בעל מספר סופי של איברים');
INSERT INTO Translation VALUES('4b67b6ac-fbb4-408a-9e7d-de5433ddb981','All terms must be integers','כל האיברים חייבים להיות שלמים');
INSERT INTO Translation VALUES('e8defed5-3818-4224-931e-2948cb6167ea','If ∫f(x)dx converges and f satisfies the conditions for the integral test, what can we conclude about Σf(n)?','אם ∫f(x)dx מתכנס ו-f מקיימת את התנאים למבחן האינטגרל, מה אנחנו יכולים להסיק על Σf(n)?');
INSERT INTO Translation VALUES('74d3e686-fe8f-4cc8-8fc4-cf7bf1b8d652','The series Σf(n) converges','הטור Σf(n) מתכנס');
INSERT INTO Translation VALUES('d64f0f0e-95d2-461d-9eb5-211022a8abad','The series Σf(n) diverges','הטור Σf(n) מתבדר');
INSERT INTO Translation VALUES('2565a4a4-e3cd-460d-8f6a-ad3caef8477e','We cannot determine convergence without more information','אנחנו לא יכולים לקבוע התכנסות בלי יותר מידע');
INSERT INTO Translation VALUES('a9f44055-8e31-4cce-86b9-5c1ae8170b88','The series oscillates','הטור מתנדד');
INSERT INTO Translation VALUES('fdcca7e4-0869-4821-87e1-0ea7fd9921f1','Using the integral test, does the series Σ(1/n²) converge?','באמצעות מבחן האינטגרל, האם הטור Σ(1/n²) מתכנס?');
INSERT INTO Translation VALUES('c41ba4ac-5821-4b2f-bbbc-715b6c905c8b','What is the comparison test for series convergence?','מה הוא מבחן ההשוואה להתכנסות טורים?');
INSERT INTO Translation VALUES('ac497297-4e2d-4c7b-b0d1-e262a699115a','If 0 ≤ aₙ ≤ bₙ and Σbₙ converges, then Σaₙ converges','אם 0 ≤ aₙ ≤ bₙ ו-Σbₙ מתכנס, אז Σaₙ מתכנס');
INSERT INTO Translation VALUES('b0bd7423-2d4c-49ec-9ec0-55fefe746f82','If aₙ < bₙ for all n, then both series have the same convergence behavior','אם aₙ < bₙ לכל n, אז לשני הטורים יש אותו התנהגות התכנסות');
INSERT INTO Translation VALUES('24f267c3-89dc-407a-bede-81492d1ce96c','Compare the ratio of consecutive terms','השווה את היחס בין איברים עוקבים');
INSERT INTO Translation VALUES('bbdada60-66ec-4ca7-9489-121aee2284c1','Sum the first n terms and compare limits','סכום n האיברים הראשונים והשווה גבולות');
