INSERT INTO Translation VALUES('b0bfc153-66d2-4177-bbb1-15e0f66eeb93','What characterizes a convergent subsequence?','מה מאפיין תת-סדרה מתכנסת?');
INSERT INTO Translation VALUES('9bc304fe-7c47-465d-ae70-ba4e9722acb0','It approaches a finite limit as n approaches infinity','היא שואפת לגבול סופי כאשר n שואף לאינסוף');
INSERT INTO Translation VALUES('9bb86e69-7645-4897-b115-22f47201ccb5','All its terms are the same','כל האיברים שלה זהים');
INSERT INTO Translation VALUES('710fcc7e-99f8-4e18-bf19-eb1639f7292c','It has finitely many terms','יש לה מספר סופי של איברים');
INSERT INTO Translation VALUES('27120006-2356-4bfb-a200-617130dd795e','It increases monotonically','היא עולה מונוטונית');
INSERT INTO Translation VALUES('6014ea7b-5cf7-4c36-851f-a4e643bb71e6','What is modus ponens in logic?','מה הוא מודוס פונס בלוגיקה?');
INSERT INTO Translation VALUES('73ee8329-4f98-413f-bb3e-aeea8bf5f1e5','If P→Q and P are true, then Q is true','אם P→Q ו-P אמיתיים, אז Q אמיתי');
INSERT INTO Translation VALUES('267b9386-a6a5-4cee-bb9f-424c95a6c9c7','If P→Q and ¬Q are true, then ¬P is true','אם P→Q ו-¬Q אמיתיים, אז ¬P אמיתי');
INSERT INTO Translation VALUES('e475c647-3419-40e3-866b-e88243c8e56a','P and Q are both true or both false','P ו-Q שניהם אמיתיים או שניהם שקריים');
INSERT INTO Translation VALUES('f9ac067c-bd48-4bd1-8d52-9a456aa16dd9','P implies not Q','P גורר לא Q');
INSERT INTO Translation VALUES('f78380ce-ea6a-4c14-b37d-ac5cefc67299','What does modus tollens state?','מה קובע מודוס טולנס?');
INSERT INTO Translation VALUES('1cf3ae59-f8bb-4b0b-a21c-69623d9b3c75','If P→Q and ¬Q are true, then ¬P is true','אם P→Q ו-¬Q אמיתיים, אז ¬P אמיתי');
INSERT INTO Translation VALUES('49e5859f-16f0-4718-86cd-0709ba732e09','If P→Q and P are true, then Q is true','אם P→Q ו-P אמיתיים, אז Q אמיתי');
INSERT INTO Translation VALUES('080c7d35-b9d2-4e20-a561-759408eea61d','If P and Q are true, then P→Q is true','אם P ו-Q אמיתיים, אז P→Q אמיתי');
INSERT INTO Translation VALUES('ea6bb44a-311f-49b5-8b50-875ef677b1f0','P and Q have the same truth value','ל-P ו-Q יש אותו ערך אמת');
INSERT INTO Translation VALUES('532738c6-082a-4e1c-ac4a-74308933e5f4','What is a truth table?','מה היא טבלת אמת?');
INSERT INTO Translation VALUES('20677c2a-a11b-44d5-bbb3-3afc970ddd17','A table showing truth values of a logical expression for all possible inputs','טבלה המציגה ערכי אמת של ביטוי לוגי לכל הקלטים האפשריים');
