INSERT INTO Translation VALUES('41e3dc7e-d012-4427-9289-fb8868692b23','A table of mathematical functions','טבלה של פונקציות מתמטיות');
INSERT INTO Translation VALUES('4c0d4648-f945-44e7-91d8-532864d8c855','A database of facts','מאגר נתונים של עובדות');
INSERT INTO Translation VALUES('e446c79a-80ca-4a0c-b8dc-2bf1c9f80c03','How many rows does a truth table have for n propositional variables?','כמה שורות יש לטבלת אמת עבור n משתנים פסוקיים?');
INSERT INTO Translation VALUES('7e7f9238-4034-4516-9fc8-0fb77b3fbca2','What does it mean for a set of propositions to be consistent?','מה המשמעות של זה שקבוצת פסוקים עקבית?');
INSERT INTO Translation VALUES('747efe49-cee2-4bee-ae74-a1ad72f226fc','There exists an assignment of truth values that makes all propositions true','קיימת השמה של ערכי אמת שהופכת את כל הפסוקים לאמיתיים');
INSERT INTO Translation VALUES('64272866-a141-4c20-bfc0-e878a0941b2e','All propositions have the same truth value','לכל הפסוקים יש אותו ערך אמת');
INSERT INTO Translation VALUES('be6423cb-5a52-4c91-8705-dad08f5e6bbf','The propositions are logically equivalent','הפסוקים שקולים לוגית');
INSERT INTO Translation VALUES('f09c4f71-e66f-49bc-b412-c4f2e2a1b745','Each proposition implies the next','כל פסוק גורר את הבא');
INSERT INTO Translation VALUES('62d51501-a228-400c-bd2a-0568ebaa0a64','What is an axiom in a logical system?','מה היא אקסיומה במערכת לוגית?');
INSERT INTO Translation VALUES('a3e878a1-aba9-496c-a155-27c438d97c34','A statement assumed to be true without proof','הצהרה הנחשבת לאמיתית ללא הוכחה');
INSERT INTO Translation VALUES('58530c95-1bcd-45d8-8608-5fd5d02468fb','A statement that has been proven','הצהרה שהוכחה');
INSERT INTO Translation VALUES('e85da6c1-e134-4753-b9d1-36f59a7b0455','A false statement used for contradiction','הצהרה שקרית המשמשת לסתירה');
INSERT INTO Translation VALUES('c4200f8b-28a3-4a48-97b6-1753d9c736ce','A variable in a logical formula','משתנה בנוסחה לוגית');
INSERT INTO Translation VALUES('cd209e15-6a9e-4771-b964-dbd5b748ad1f','What does soundness mean in a logical system?','מה המשמעות של תקינות במערכת לוגית?');
INSERT INTO Translation VALUES('0becf741-e5ec-442b-a4de-f7859aa4e6f4','Every provable statement is true in all models','כל הצהרה הוכיחה היא אמיתית בכל המודלים');
INSERT INTO Translation VALUES('adc92c1f-ac17-4013-9df6-9bd60e5042c4','Every true statement is provable','כל הצהרה אמיתית ניתנת להוכחה');
INSERT INTO Translation VALUES('08b394dc-8e0a-455b-8df1-1b1b85ec5f0b','The system has no contradictions','במערכת אין סתירות');
INSERT INTO Translation VALUES('c23ba499-5b17-4654-9ccb-8f48c2955832','All axioms are independent','כל האקסיומות עצמאיות');
INSERT INTO Translation VALUES('82ab874a-22ef-4592-950a-f4930ba75853','What does completeness mean in a logical system?','מה המשמעות של שלמות במערכת לוגית?');
INSERT INTO Translation VALUES('a88142aa-af73-4910-af00-98b2825b5862','Every true statement in all models is provable','כל הצהרה אמיתית בכל המודלים ניתנת להוכחה');
INSERT INTO Translation VALUES('f1c83661-bf19-4a88-a372-1c98c3b9cabc','Every provable statement is true','כל הצהרה הוכיחה היא אמיתית');
INSERT INTO Translation VALUES('279dcb48-1116-4faf-a2b2-fd4a8460eee6','The system can prove or disprove every statement','המערכת יכולה להוכיח או להפריך כל הצהרה');
INSERT INTO Translation VALUES('6c16e6fe-268e-4c24-ab97-4997ad81d786','All statements are decidable','כל ההצהרות כריעות');
INSERT INTO Translation VALUES('a12390b8-2f5d-4f97-aea9-0943148196b1','What is the main purpose of representing functions as power series?','מה המטרה העיקרית של ייצוג פונקציות כטורי חזקות?');
INSERT INTO Translation VALUES('f6be9db3-eef6-4e29-92fc-e2dfd5084605','To approximate complex functions with simpler polynomial expressions','כדי לקרב פונקציות מורכבות באמצעות ביטויים פולינומיים פשוטים יותר');
INSERT INTO Translation VALUES('4822a1b7-d68e-40bc-9f7f-c625aa09ffd0','To make functions more complex','כדי להפוך פונקציות למורכבות יותר');
INSERT INTO Translation VALUES('add2c677-ac61-4d98-860d-9d69f39a67d7','To eliminate derivatives','כדי לבטל נגזרות');
INSERT INTO Translation VALUES('6f04438e-baff-47d3-8591-b7657b5b1ed9','To convert functions to exponential form','כדי להמיר פונקציות לצורה אקספוננציאלית');
