INSERT INTO Translation VALUES('c3816562-4828-44b2-b02d-1f349b07b0de','∑(n=0 to ∞) aₙ(x-c)ⁿ','∑(n=0 to ∞) aₙ(x-c)ⁿ');
INSERT INTO Translation VALUES('b3e1070a-fe70-4b3b-af7b-333e598cfdec','∑(n=0 to ∞) aₙxⁿ + c','∑(n=0 to ∞) aₙxⁿ + c');
INSERT INTO Translation VALUES('d04ab6c8-dedc-4560-9720-4d1cef41091b','∑(n=1 to ∞) aₙ/xⁿ','∑(n=1 to ∞) aₙ/xⁿ');
INSERT INTO Translation VALUES('71cb367b-5b80-4825-adaf-35d978576334','∏(n=0 to ∞) aₙxⁿ','∏(n=0 to ∞) aₙxⁿ');
INSERT INTO Translation VALUES('ed757b27-8649-4fff-b4fb-b68c3a0f033a','What is the radius of convergence for a power series ∑aₙxⁿ?','מה רדיוס ההתכנסות לטור חזקות ∑aₙxⁿ?');
INSERT INTO Translation VALUES('633c848b-e4a5-438d-ac1a-d35bfb82cb20','The value R such that the series converges for |x| < R and diverges for |x| > R','הערך R כך שהטור מתכנס עבור |x| < R ומתבדר עבור |x| > R');
INSERT INTO Translation VALUES('134e49a3-02bc-4ae3-8185-a599c765dbb8','The maximum value of x for which the series converges','הערך המקסימלי של x עבורו הטור מתכנס');
INSERT INTO Translation VALUES('d2ed98b7-f589-45f1-99cd-604b60234863','The center point of the power series','נקודת המרכז של טור החזקות');
INSERT INTO Translation VALUES('70391961-3e6f-438f-a43a-beb1a7502fdd','The sum of all coefficients aₙ','הסכום של כל המקדמים aₙ');
INSERT INTO Translation VALUES('71897719-2390-40f7-8c1a-aedc6d9e6a84','Which method can be used to find the radius of convergence of a power series?','איזה שיטה יכולה לשמש למציאת רדיוס ההתכנסות של טור חזקות?');
INSERT INTO Translation VALUES('bae3e427-2522-449e-98f5-cf93e814d6af','Ratio test or root test','מבחן היחס או מבחן השורש');
INSERT INTO Translation VALUES('d4e2bc1f-eff6-4c07-8073-1b06fbe7bf6b','Integration by parts','אינטגרציה בחלקים');
INSERT INTO Translation VALUES('b485d57f-a837-426a-aa0c-ad11d3073356','L''Hôpital''s rule','כלל לופיטל');
INSERT INTO Translation VALUES('8b633690-718a-433f-8fcc-1214f41a500e','Chain rule','כלל השרשרת');
INSERT INTO Translation VALUES('a3fb9bed-64f3-4948-bbd0-8d3d2140c611','What happens to the differentiability of a power series within its radius of convergence?','מה קורה לגזירות של טור חזקות בתחום רדיוס ההתכנסות שלו?');
INSERT INTO Translation VALUES('d0f6047b-c933-4df4-a5c5-93629e979da5','The power series is infinitely differentiable','טור החזקות גזיר אינסוף פעמים');
