INSERT INTO Translation VALUES('7a5aa4e3-1c2a-471f-be84-038f523d480e','The power series is differentiable only once','טור החזקות גזיר רק פעם אחת');
INSERT INTO Translation VALUES('b25b12cf-267b-43ae-8b9b-985a61165f17','The differentiability depends on the coefficients','הגזירות תלויה במקדמים');
INSERT INTO Translation VALUES('a9d26b80-671b-4f1d-a76d-3d2f797168e6','How do you integrate a power series term by term?','איך מבצעים אינטגרציה של טור חזקות איבר איבר?');
