INSERT INTO Translation VALUES('260248e3-4288-41b7-970b-38634436a73f','∫∑aₙxⁿdx = ∑naₙxⁿ⁻¹ + C','∫∑aₙxⁿdx = ∑naₙxⁿ⁻¹ + C');
INSERT INTO Translation VALUES('af75307d-2a9c-47eb-945b-1ef08f97181e','∫∑aₙxⁿdx = ∑aₙ/(n+1) + C','∫∑aₙxⁿdx = ∑aₙ/(n+1) + C');
INSERT INTO Translation VALUES('a7f0c26e-7920-4c85-a622-5367ece26a29','Cannot integrate term by term','לא ניתן לבצע אינטגרציה איבר איבר');
INSERT INTO Translation VALUES('8c996610-1f6a-475d-bd71-ac8b48e24fd4','What is the continuity property of power series?','מה תכונת הרציפות של טורי חזקות?');
INSERT INTO Translation VALUES('2c60a216-232c-498d-bf33-e9d923500e6b','A power series is continuous within its radius of convergence','טור חזקות הוא רציף בתחום רדיוס ההתכנסות שלו');
INSERT INTO Translation VALUES('50a79d0e-9126-4b55-8837-0573cb680b42','Power series are never continuous','טורי חזקות אינם רציפים לעולם');
INSERT INTO Translation VALUES('14441968-6c17-4576-872c-5378e3a0701c','Continuity depends on the center point only','הרציפות תלויה רק בנקודת המרכז');
INSERT INTO Translation VALUES('31d138a2-41b2-4841-bbda-777da36accd8','Power series are continuous everywhere','טורי חזקות רציפים בכל מקום');
INSERT INTO Translation VALUES('ec220ed9-0265-49b3-9312-1707dbc70727','If f(x) ≤ g(x) on [a,b], what can we say about their definite integrals?','אם f(x) ≤ g(x) על [a,b], מה ניתן לומר על האינטגרלים המוגדרים שלהן?');
