INSERT INTO Translation VALUES('f87d04ec-aa71-4983-9b4d-8b7549d31113','∫ₐᵇ f(x)dx > ∫ₐᵇ g(x)dx','∫ₐᵇ f(x)dx > ∫ₐᵇ g(x)dx');
INSERT INTO Translation VALUES('4a68b9e7-5a99-45b4-a42f-17776c394925','The integrals are equal','האינטגרלים שווים');
INSERT INTO Translation VALUES('c0b27dd6-310c-4cc1-afaa-9ec85fe2a39d','No relationship can be determined','לא ניתן לקבוע קשר');
INSERT INTO Translation VALUES('34705c8a-d1d6-404f-bce0-775f1140367c','What is the triangle inequality for definite integrals?','מה אי-השוויון המשולש לאינטגרלים מוגדרים?');
INSERT INTO Translation VALUES('f7f8adf7-eec4-4356-878c-591786a2ebcf','|∫ₐᵇ f(x)dx| ≤ ∫ₐᵇ |f(x)|dx','|∫ₐᵇ f(x)dx| ≤ ∫ₐᵇ |f(x)|dx');
INSERT INTO Translation VALUES('59df992a-dd56-4579-9a94-7cc550e1cc4f','|∫ₐᵇ f(x)dx| ≥ ∫ₐᵇ |f(x)|dx','|∫ₐᵇ f(x)dx| ≥ ∫ₐᵇ |f(x)|dx');
INSERT INTO Translation VALUES('60c64dcd-0e29-43a3-bb80-32a706162a17','|∫ₐᵇ f(x)dx| = ∫ₐᵇ |f(x)|dx','|∫ₐᵇ f(x)dx| = ∫ₐᵇ |f(x)|dx');
INSERT INTO Translation VALUES('0ed222c0-ef7c-4d8c-b8c4-6ed6c106a8bd','∫ₐᵇ f(x)dx ≤ |∫ₐᵇ f(x)dx|','∫ₐᵇ f(x)dx ≤ |∫ₐᵇ f(x)dx|');
INSERT INTO Translation VALUES('00e7d5a9-a2ec-45df-ac16-0adb484851c6','What does the comparison property of definite integrals state?','מה קובעת תכונת ההשוואה של אינטגרלים מוגדרים?');
INSERT INTO Translation VALUES('1c67059d-aace-41a8-9a1f-ce877f00fd78','If 0 ≤ f(x) ≤ g(x) on [a,b], then 0 ≤ ∫ₐᵇ f(x)dx ≤ ∫ₐᵇ g(x)dx','אם 0 ≤ f(x) ≤ g(x) על [a,b], אז 0 ≤ ∫ₐᵇ f(x)dx ≤ ∫ₐᵇ g(x)dx');
INSERT INTO Translation VALUES('8c266f5c-9e6f-4792-a67f-403f55cad4a5','All definite integrals are positive','כל האינטגרלים המוגדרים חיוביים');
INSERT INTO Translation VALUES('86beeeb7-e53b-4970-8b86-3dae0235af90','Integrals can be compared only when they have the same limits','ניתן להשוות אינטגרלים רק כאשר יש להם אותם גבולות');
INSERT INTO Translation VALUES('8851586e-1074-45d7-86b0-0d37671349fd','The comparison depends on the antiderivative','ההשוואה תלויה בפונקציה הקדומה');
INSERT INTO Translation VALUES('64a29911-ef16-40cd-8053-0ee1238fad95','If lim(n→∞) aₙ = L, what can we say about the sequence behavior?','אם lim(n→∞) aₙ = L, מה ניתן לומר על התנהגות הסדרה?');
INSERT INTO Translation VALUES('e09b01ce-a9d1-4859-9cd7-53aad3de96f2','The sequence converges to the finite limit L','הסדרה מתכנסת לגבול הסופי L');
INSERT INTO Translation VALUES('f7cefa9c-c589-4b00-893f-9f6840365525','The sequence diverges to infinity','הסדרה מתבדרת לאינסוף');
INSERT INTO Translation VALUES('dee4046e-9f41-4b4b-8d87-910dcd4ccb45','The sequence oscillates indefinitely','הסדרה מתנדנדת לאינסוף');
INSERT INTO Translation VALUES('53067aee-af29-4d5f-b094-0cf8be58864a','The limit does not exist','הגבול לא קיים');
INSERT INTO Translation VALUES('5e8ba72e-05f1-4a65-a80f-473946481fca','What does it mean for a sequence to converge to infinity?','מה המשמעות של התכנסות סדרה לאינסוף?');
INSERT INTO Translation VALUES('c41f619a-42a1-4061-bd39-bea02c9a2fb0','For every M > 0, there exists N such that for n > N, aₙ > M','לכל M > 0, קיים N כך שלכל n > N, aₙ > M');
