INSERT INTO Translation VALUES('48761122-6f8a-4bf9-a944-449e2e30fd00','The sequence becomes constant','הסדרה הופכת קבועה');
INSERT INTO Translation VALUES('a9376bdf-a62e-4ec9-8cd8-2a5075853b26','The sequence has no pattern','לסדרה אין תבנית');
INSERT INTO Translation VALUES('8c4cbedc-ee94-476e-8cf7-fe7d2511d7c9','What is the formal definition of divergence to negative infinity?','מה ההגדרה הפורמלית של התבדרות למינוס אינסוף?');
INSERT INTO Translation VALUES('a2c09469-51ce-4e58-b64f-a301fcaa00e8','For every M < 0, there exists N such that for n > N, aₙ < M','לכל M < 0, קיים N כך שלכל n > N, aₙ < M');
