INSERT INTO Translation VALUES('89b7536b-60fb-47b3-aece-176e2bd9ec72','All terms are negative','כל האיברים שליליים');
INSERT INTO Translation VALUES('ffcb107b-bdb3-42b1-a3b5-2bd9f6eb9d79','The sequence decreases monotonically','הסדרה פוחתת באופן מונוטוני');
INSERT INTO Translation VALUES('31e1ceec-cbb6-4a6d-af4f-05b2a7a64973','What is the Bolzano-Weierstrass theorem for subsequences?','מה משפט בולצאנו-ויירשטראס לתת-סדרות?');
INSERT INTO Translation VALUES('5f3c4c15-719a-4f61-8e59-6c6ab96b7f15','Every bounded sequence has a convergent subsequence','לכל סדרה חסומה יש תת-סדרה מתכנסת');
INSERT INTO Translation VALUES('c1d6c6a0-da05-4809-8a75-d7fb532aaacf','Every sequence has a bounded subsequence','לכל סדרה יש תת-סדרה חסומה');
