INSERT INTO Translation VALUES('21af0c64-7cee-4f4d-9b6b-2906ab4b198e','What does the Implicit Function Theorem guarantee?','מה מבטיח משפט הפונקציה הסמויה?');
INSERT INTO Translation VALUES('87cd0b7b-ff44-410e-9158-4bae021a4c25','Under certain conditions, an equation F(x,y) = 0 locally defines y as a function of x','בתנאים מסוימים, משוואה F(x,y) = 0 מגדירה מקומית את y כפונקציה של x');
