INSERT INTO Translation VALUES('b1efbdb6-d001-42b5-992e-0d25b1b062e2','How do you find dy/dx for an implicitly defined function F(x,y) = 0?','איך מוצאים dy/dx לפונקציה המוגדרת באופן סמוי F(x,y) = 0?');
INSERT INTO Translation VALUES('b194a8e3-7a30-408b-b249-d75ebed07705','dy/dx = -(∂F/∂x)/(∂F/∂y)','dy/dx = -(∂F/∂x)/(∂F/∂y)');
INSERT INTO Translation VALUES('9a84618e-4bb8-419c-965d-9f5823428264','dy/dx = (∂F/∂x)/(∂F/∂y)','dy/dx = (∂F/∂x)/(∂F/∂y)');
INSERT INTO Translation VALUES('d352e456-dc87-4c19-bd0e-ca8a17ea4047','dy/dx = ∂F/∂y','dy/dx = ∂F/∂y');
INSERT INTO Translation VALUES('4b6b56d6-37e5-4a6c-bd26-bc158c179af8','dy/dx = ∂F/∂x','dy/dx = ∂F/∂x');
INSERT INTO Translation VALUES('70f93d01-f30c-46ea-82b2-ec26eaf9cb64','What is the formula for integration by parts?','מה הנוסחה לאינטגרציה בחלקים?');
INSERT INTO Translation VALUES('3904f875-df54-4828-9e80-edc871bce7c1','∫u dv = uv - ∫v du','∫u dv = uv - ∫v du');
