INSERT INTO Translation VALUES('25091052-1e40-4f24-9027-b2930df8ac5c','∫u dv = u''v - ∫v'' du','∫u dv = u''v - ∫v'' du');
INSERT INTO Translation VALUES('99189077-666f-417b-bc73-ac8bb0841e06','∫u dv = ∫u du + ∫v dv','∫u dv = ∫u du + ∫v dv');
INSERT INTO Translation VALUES('ab43471f-fc70-4cee-a80c-d4a2e0b4633a','When is integration by parts most useful?','מתי אינטגרציה בחלקים הכי שימושית?');
INSERT INTO Translation VALUES('868c5a0c-c369-40b5-a3a4-78d4561fe54f','When the integrand is a product of two functions, one easily differentiable and the other easily integrable','כאשר האינטגרנד הוא מכפלה של שתי פונקציות, אחת קלה לגזירה והאחרת קלה לאינטגרציה');
