INSERT INTO Translation VALUES('9da50769-d558-4f0b-80d1-d355f56857dc','What is the definition of the right-hand derivative?','מה ההגדרה של הנגזרת הימנית?');
INSERT INTO Translation VALUES('674519ca-db7f-4bc7-b6e9-d8d565051fcc','f''₊(a) = lim(h→0⁺) [f(a+h) - f(a)]/h','f''₊(a) = lim(h→0⁺) [f(a+h) - f(a)]/h');
INSERT INTO Translation VALUES('c0cc1cb4-b11d-456c-b77c-95c9959c6ad8','f''₊(a) = lim(h→0⁻) [f(a+h) - f(a)]/h','f''₊(a) = lim(h→0⁻) [f(a+h) - f(a)]/h');
INSERT INTO Translation VALUES('0e633d84-db31-4554-ab73-3e17e721ec8b','f''₊(a) = [f(a+1) - f(a)]/1','f''₊(a) = [f(a+1) - f(a)]/1');
INSERT INTO Translation VALUES('3d368611-74af-4e14-a948-8948c2d924e2','f''₊(a) = f(a+h) for small h > 0','f''₊(a) = f(a+h) עבור h קטן > 0');
INSERT INTO Translation VALUES('31e847b9-5dd8-4501-bd36-317c515a20a5','What is the definition of the left-hand derivative?','מה ההגדרה של הנגזרת השמאלית?');
INSERT INTO Translation VALUES('dfa51a3e-35c5-48cf-8628-ddd252a2a01c','f''₋(a) = lim(h→0⁻) [f(a+h) - f(a)]/h','f''₋(a) = lim(h→0⁻) [f(a+h) - f(a)]/h');
INSERT INTO Translation VALUES('51acae85-c63d-4f07-97e6-f79e6421ab7e','f''₋(a) = lim(h→0⁺) [f(a+h) - f(a)]/h','f''₋(a) = lim(h→0⁺) [f(a+h) - f(a)]/h');
INSERT INTO Translation VALUES('2e889e76-68ae-429c-b194-2dc51e81d037','f''₋(a) = [f(a-1) - f(a)]/(-1)','f''₋(a) = [f(a-1) - f(a)]/(-1)');
INSERT INTO Translation VALUES('e4c98c19-f173-4f7e-acad-3ca64b049d4a','f''₋(a) = -f''(a)','f''₋(a) = -f''(a)');
INSERT INTO Translation VALUES('8324b35f-4d6b-42de-bcee-be599665ff18','When does a function have a derivative at a point?','מתי לפונקציה יש נגזרת בנקודה?');
INSERT INTO Translation VALUES('0782c3af-9e88-4efc-9052-c57e5d37f001','When both one-sided derivatives exist and are equal','כאשר שתי הנגזרות החד-צדדיות קיימות ושוות');
INSERT INTO Translation VALUES('339ae2f9-4806-403e-9c2f-b94af72ad2c9','When only the right-hand derivative exists','כאשר רק הנגזרת הימנית קיימת');
INSERT INTO Translation VALUES('9589dc71-e6b3-47b0-81dd-cbd9c5c5c7e5','When the function is continuous','כאשר הפונקציה רציפה');
INSERT INTO Translation VALUES('027fffb2-e1dc-4ed1-878b-d473e9c37584','When the function is bounded','כאשר הפונקציה חסומה');
INSERT INTO Translation VALUES('97536a74-5d75-4cc0-867b-6010bcc0a995','What is the relationship between differentiability and continuity?','מה הקשר בין גזירות לרציפות?');
INSERT INTO Translation VALUES('b945fe9c-be01-435e-962a-37f9931416bf','If a function is differentiable at a point, then it is continuous at that point','אם פונקציה גזירה בנקודה, אז היא רציפה באותה נקודה');
INSERT INTO Translation VALUES('f8ad4621-9932-481d-9726-e5c7b3036130','If a function is continuous, then it is differentiable','אם פונקציה רציפה, אז היא גזירה');
