INSERT INTO Translation VALUES('a2827f0a-e6a1-409c-a90b-1b442fa4e982','A function can be differentiable but not continuous','פונקציה יכולה להיות גזירה אבל לא רציפה');
INSERT INTO Translation VALUES('7efcb19c-d605-44eb-9b91-58a477eabec0','Can a continuous function be non-differentiable?','האם פונקציה רציפה יכולה להיות לא גזירה?');
