INSERT INTO Translation VALUES('1cef576a-c463-4dc4-a9cc-8d2a60a55a6c','f(x) = |x| at x = 0','f(x) = |x| ב-x = 0');
INSERT INTO Translation VALUES('b5f098ef-a46c-4aaf-ba40-70b80c36a79c','f(x) = x² everywhere','f(x) = x² בכל מקום');
INSERT INTO Translation VALUES('085ad7c3-3155-4354-b366-b7bf391a5e13','f(x) = sin(x) everywhere','f(x) = sin(x) בכל מקום');
