INSERT INTO Translation VALUES('b02fe75b-751a-4e78-83de-ec1c9d55b26d','f''''(x) = 2f''(x)','f''''(x) = 2f''(x)');
INSERT INTO Translation VALUES('8c7602ab-5c38-454b-a2f0-34e5c7bc4024','f''''(x) = [f''(x)]²','f''''(x) = [f''(x)]²');
INSERT INTO Translation VALUES('cdbbca46-3ec0-4e32-975e-86a3bb1f0af2','f''''(x) = f(x) + f''(x)','f''''(x) = f(x) + f''(x)');
INSERT INTO Translation VALUES('5f830681-38fc-495d-b412-6d9c161ef196','What does the second derivative tell us about a function?','מה הנגזרת השנייה אומרת לנו על פונקציה?');
INSERT INTO Translation VALUES('86e82550-5b68-4313-a01b-25c65ce1d92e','It indicates the concavity and rate of change of the slope','היא מציינת את הקעירות ואת קצב השינוי של השיפוע');
