INSERT INTO Translation VALUES('5812678c-c3f3-456e-af9d-e2d9810aea47','It shows the x-intercepts','היא מראה את נקודות החיתוך עם ציר x');
INSERT INTO Translation VALUES('069cce12-fe85-4696-9027-d3e31b6b848c','It determines the domain of the function','היא קובעת את התחום של הפונקציה');
INSERT INTO Translation VALUES('44359c66-abba-438f-8ebd-29c535771ed3','If f''''(x) > 0, what can we say about the function?','אם f''''(x) > 0, מה ניתן לומר על הפונקציה?');
