INSERT INTO Translation VALUES('305140fd-c959-4be4-bb56-4192194b0e00','f(x) > 0 means concave up, f(x) < 0 means concave down','f(x) > 0 אומר קעורה כלפי מעלה, f(x) < 0 אומר קעורה כלפי מטה');
