INSERT INTO Translation VALUES('cd1edd0f-6709-4f6f-bcc1-01aa0749eba4','When choosing u and dv in integration by parts, what principle should guide the selection?','בבחירת u ו-dv באינטגרציה בחלקים, איזה עיקרון צריך להנחות את הבחירה?');
INSERT INTO Translation VALUES('5da732c4-a301-43d7-a174-761f3ac3545b','Choose u to become simpler when differentiated and dv to be easily integrable','בחר u שנהיה פשוט יותר כשגוזרים ו-dv שקל לאנטגרל');
INSERT INTO Translation VALUES('6091b994-f95e-494d-ac1e-d34bbf6a2ae9','Always choose the more complex function as u','תמיד בחר את הפונקציה המורכבת יותר בתור u');
