INSERT INTO Translation VALUES('e66fd1d7-9d08-435f-8366-3dcb19214790','How many times might integration by parts need to be applied for ∫ x²eˣ dx?','כמה פעמים ייתכן שיהיה צריך להחיל אינטגרציה בחלקים עבור ∫ x²eˣ dx?');
