INSERT INTO Translation VALUES('6717f3b8-b4d0-4f8f-ab65-25244ab136e8','Is the multiplication principle applicable when choices are independent?','האם עיקרון הכפל ישים כאשר הבחירות הן בלתי תלויות?');
