INSERT INTO Translation VALUES('32b869d4-c904-44e7-98b1-3e3a4bbb171b','The function is undefined at that point','הפונקציה לא מוגדרת באותה נקודה');
INSERT INTO Translation VALUES('4781afc6-9959-4664-9420-60411fe9009f','Calculate f''(2) for f(x) = 3x using the limit definition.','חשב f''(2) עבור f(x) = 3x באמצעות הגדרת הגבול.');
INSERT INTO Translation VALUES('d83df0e9-4c39-4119-8ce5-89dda61e6829','Which notation is NOT commonly used for the derivative?','איזה סימון אינו נפוץ לציון הנגזרת?');
INSERT INTO Translation VALUES('a9c03d14-0b4a-4d3b-9622-cc5b1ffa5c71','f⁻¹(x)','f⁻¹(x)');
INSERT INTO Translation VALUES('1926e1a7-1e88-4208-a6e3-7dbcc4a93103','f''(x)','f''(x)');
INSERT INTO Translation VALUES('2dc37509-711a-4e93-b4a7-620b2fc2014d','df/dx','df/dx');
INSERT INTO Translation VALUES('274ef9d9-c3f5-4532-8dbd-4ce5109928f3','Df(x)','Df(x)');
INSERT INTO Translation VALUES('ba73b758-a536-4cd7-8aee-4b6c3bf0f7e2','Is the function f(x) = x^(1/3) differentiable at x = 0?','האם הפונקציה f(x) = x^(1/3) גזירה בנקודה x = 0?');
INSERT INTO Translation VALUES('2ce8a4d7-0ba2-404e-9d21-038658016fae','What is the derivative of f(x) = c (where c is a constant)?','מה הנגזרת של f(x) = c (כאשר c קבוע)?');
INSERT INTO Translation VALUES('1028ac68-b823-4517-9c50-f912b07a76be','If f(x) = x³, what is f''(1) using the definition?','אם f(x) = x³, מה f''(1) באמצעות ההגדרה?');
INSERT INTO Translation VALUES('51729dcb-0957-439d-8c34-b29085a0c9ba','The derivative represents the instantaneous rate of change of a function.','הנגזרת מייצגת את קצב השינוי הרגעי של פונקציה.');
INSERT INTO Translation VALUES('e8f768a1-1673-485b-a9a0-6c8939cd07d3','What condition must be satisfied for a function to be differentiable at a point?','איזה תנאי חייב להתקיים כדי שפונקציה תהיה גזירה בנקודה?');
INSERT INTO Translation VALUES('e8ee8267-0c7e-4f8b-bfbb-7504196a5622','The limit defining the derivative must exist and be finite','הגבול המגדיר את הנגזרת חייב להתקיים ולהיות סופי');
INSERT INTO Translation VALUES('fc404a0e-1143-463b-9aca-c8580ec52fd8','The function must be bounded','הפונקציה חייבת להיות חסומה');
INSERT INTO Translation VALUES('3bd76ae6-e477-4f0d-8bea-149c3d91e2ed','The function must be monotonic','הפונקציה חייבת להיות מונוטונית');
INSERT INTO Translation VALUES('0854fe59-e21a-4083-894c-309dff50c61f','The function must have a local extremum','לפונקציה חייב להיות קיצון מקומי');
INSERT INTO Translation VALUES('494d3d2f-d7dc-4fca-9142-e8e8fc168c62','Calculate the derivative of f(x) = 1/x at x = 2 using the definition.','חשב את הנגזרת של f(x) = 1/x בנקודה x = 2 באמצעות ההגדרה.');
INSERT INTO Translation VALUES('9da9af90-18a6-43a7-ab94-2613e0ca0e48','If f is differentiable at x = a, then lim_{x→a} f(x) = f(a).','אם f גזירה ב-x = a, אז lim_{x→a} f(x) = f(a).');
INSERT INTO Translation VALUES('8118561e-cdf2-4e59-8829-e1e3b717d669','What is the difference quotient for a function f at point a with increment h?','מה מנת ההפרש של פונקציה f בנקודה a עם תוספת h?');
INSERT INTO Translation VALUES('a716e88f-4135-4029-8b2a-e24f75829662','[f(a+h) - f(a)]/h','[f(a+h) - f(a)]/h');
INSERT INTO Translation VALUES('b951c1ab-410a-48fd-8ac8-001d5562c83b','[f(a) - f(a+h)]/h','[f(a) - f(a+h)]/h');
INSERT INTO Translation VALUES('928122cc-ea67-4dec-869b-4552074f4bee','[f(a+h) + f(a)]/h','[f(a+h) + f(a)]/h');
INSERT INTO Translation VALUES('0d7c0fa2-98fb-42ef-8608-209fc689dbc3','f(a+h) - f(a)','f(a+h) - f(a)');
INSERT INTO Translation VALUES('df262b3a-b0ad-4d6e-ac84-b9183952f3c6','For f(x) = √x, what is f''(4) using the limit definition?','עבור f(x) = √x, מה f''(4) באמצעות הגדרת הגבול?');
INSERT INTO Translation VALUES('27f5549a-89f5-456b-8c5f-4c5b5dd06423','The derivative of a function at a point gives the slope of which line?','הנגזרת של פונקציה בנקודה נותנת את השיפוע של איזה ישר?');
INSERT INTO Translation VALUES('0786756d-edf4-4920-b12f-0357ac5689ac','The tangent line at that point','הישר המשיק באותה נקודה');
INSERT INTO Translation VALUES('449d6a2d-cda9-4604-a35c-2b1f5646cfe3','The secant line through two points','הישר החותך דרך שתי נקודות');
INSERT INTO Translation VALUES('f05f9505-fee8-4844-8820-db2b95560139','The normal line at that point','הישר הנורמל באותה נקודה');
INSERT INTO Translation VALUES('0efd4575-0371-4629-bfc1-b7b03b2c0551','The horizontal line through that point','הישר האופקי דרך אותה נקודה');
INSERT INTO Translation VALUES('a059ef18-0e05-48c7-9f69-99d748e779b7','Can a function have a vertical tangent line at a point where it''s continuous?','האם פונקציה יכולה להיות בעלת ישר משיק אנכי בנקודה שבה היא רציפה?');
INSERT INTO Translation VALUES('ffc93257-c0b2-4264-990b-ca31ff2cd3ff','What happens to the derivative when the tangent line is horizontal?','מה קורה לנגזרת כאשר הישר המשיק הוא אופקי?');
INSERT INTO Translation VALUES('c1fbbb08-5415-4f35-a7e5-c12b849825c4','If f(x) = ax + b, what is f''(x) for any x?','אם f(x) = ax + b, מה f''(x) עבור כל x?');
INSERT INTO Translation VALUES('4016bccb-e6c3-4716-91a1-5d0124e2b14e','a','a');
INSERT INTO Translation VALUES('cb3ec7db-98a1-4d91-80cf-b2bcbf96cc13','b','b');
INSERT INTO Translation VALUES('e3f581c5-5b77-44ff-a37d-56ba7cc77d9c','ax','ax');
INSERT INTO Translation VALUES('0da60bd8-212a-4228-a8e2-68adb27a7525','a + b','a + b');
INSERT INTO Translation VALUES('0fa4b400-7dc4-4c1e-a7e6-0695da3c5a71','The derivative of f(x) = x² at x = 0 is 0.','הנגזרת של f(x) = x² בנקודה x = 0 היא 0.');
INSERT INTO Translation VALUES('6cd8a6c8-b7c8-4ee5-b350-c7ec29702beb','For which value of a is f(x) = |x - a| not differentiable?','עבור איזה ערך של a הפונקציה f(x) = |x - a| אינה גזירה?');
INSERT INTO Translation VALUES('7aa14df1-0881-4ce3-b45e-6e6a27cab0a9','x = a','x = a');
INSERT INTO Translation VALUES('2c3f3609-64e1-42d8-9e3d-662e1719d664','x = 0','x = 0');
INSERT INTO Translation VALUES('16580308-0f18-4466-bedc-1771d57a9288','x = -a','x = -a');
INSERT INTO Translation VALUES('f5f73182-2360-4df1-aaa2-f5e924338fc0','All values of x','כל ערכי x');
INSERT INTO Translation VALUES('da14eb36-5312-427e-b65c-2a6c97144799','Calculate f''(0) for f(x) = x|x| using the definition.','חשב f''(0) עבור f(x) = x|x| באמצעות ההגדרה.');
INSERT INTO Translation VALUES('38605613-6689-4447-8fd9-d2a4e2904c53','What is the relationship between the existence of a derivative and local linearity?','מה הקשר בין קיום נגזרת לליניאריות מקומית?');
INSERT INTO Translation VALUES('5bef8344-c7b5-41e7-8b08-ff74e8ba617f','If the derivative exists, the function is locally linear','אם הנגזרת קיימת, הפונקציה לינארית מקומית');
INSERT INTO Translation VALUES('ea775d17-7d83-4bea-93c9-d35a2de1a51e','Local linearity implies the derivative doesn''t exist','ליניאריות מקומית מרמזת שהנגזרת לא קיימת');
INSERT INTO Translation VALUES('4f7e689f-4500-48b9-addd-9bf7a735e8a3','They are unrelated concepts','אלו מושגים לא קשורים');
INSERT INTO Translation VALUES('378d3d00-c5e0-4dbf-bf1f-f7284bdfbfa6','Local linearity only exists at discontinuities','ליניאריות מקומית קיימת רק באי-רציפויות');
INSERT INTO Translation VALUES('52b418e6-d1bb-45ad-9838-dde54992e60e','If f''(a) = ∞, then f is not differentiable at x = a.','אם f''(a) = ∞, אז f אינה גזירה ב-x = a.');
INSERT INTO Translation VALUES('a54da226-51f3-4c33-b253-42d9c49bd5a1','For f(x) = x^(2/3), what happens to f''(x) as x approaches 0?','עבור f(x) = x^(2/3), מה קורה ל-f''(x) כאשר x מתקרב ל-0?');
INSERT INTO Translation VALUES('e708e964-474d-4666-b034-3a391aac5219','f''(x) approaches infinity','f''(x) מתקרב לאינסוף');
INSERT INTO Translation VALUES('11b7a73b-1393-44f4-bf98-c53ecbeb1cd0','f''(x) approaches 0','f''(x) מתקרב ל-0');
INSERT INTO Translation VALUES('3b44c67f-cbd4-45af-a422-7b3cf6bcc081','f''(x) approaches 1','f''(x) מתקרב ל-1');
INSERT INTO Translation VALUES('e2a7f5bb-d9b1-4a43-95e3-13c953e9865b','f''(x) is undefined everywhere','f''(x) לא מוגדר בכל מקום');
INSERT INTO Translation VALUES('0426c808-79f6-4b4e-8639-c15d8b5d3b4b','Calculate the derivative of f(x) = x⁴ at x = -1 using the definition.','חשב את הנגזרת של f(x) = x⁴ בנקודה x = -1 באמצעות ההגדרה.');
INSERT INTO Translation VALUES('f08127bb-fc1c-43f4-a4ca-d7b5486b2bd5','Which of the following functions is differentiable everywhere on its domain?','איזו מהפונקציות הבאות גזירה בכל מקום בתחום שלה?');
INSERT INTO Translation VALUES('acdf1085-46c1-442b-b38f-48c6229c3435','f(x) = x³ + 2x² - 5x + 1','f(x) = x³ + 2x² - 5x + 1');
INSERT INTO Translation VALUES('d21841bb-6005-4f3b-8518-ed0444902aa8','f(x) = |x - 2|','f(x) = |x - 2|');
INSERT INTO Translation VALUES('11cb168a-b2e3-4026-a939-f92e770ee69f','f(x) = ∛x','f(x) = ∛x');
INSERT INTO Translation VALUES('bbfa32e2-4beb-4237-b6ee-13e6f8a2167c','f(x) = max(x, 0)','f(x) = max(x, 0)');
INSERT INTO Translation VALUES('494ff458-cc5f-47d3-b8f4-fe802b97f382','The limit lim_{h→0} [f(a+h) - f(a-h)]/(2h) always equals f''(a) when f''(a) exists.','הגבול lim_{h→0} [f(a+h) - f(a-h)]/(2h) תמיד שווה ל-f''(a) כאשר f''(a) קיימת.');
INSERT INTO Translation VALUES('9d833eec-2824-4730-a0cf-9423b2c03128','For f(x) = sin(x), what is f''(π/2) using the definition?','עבור f(x) = sin(x), מה f''(π/2) באמצעות ההגדרה?');
INSERT INTO Translation VALUES('39c99574-e972-45dc-995b-a91590082871','If f has a corner at x = a, what can we say about f''(a)?','אם ל-f יש פינה ב-x = a, מה אנו יכולים לומר על f''(a)?');
INSERT INTO Translation VALUES('22253f85-de15-41d3-98ac-62bf035f4f5b','f''(a) does not exist','f''(a) לא קיימת');
INSERT INTO Translation VALUES('7a605cdd-ca3e-426f-bb0b-8cce0279432a','f''(a) = 0','f''(a) = 0');
INSERT INTO Translation VALUES('9145a89d-5fcb-4610-bf33-2825cd1d570c','f''(a) = ∞','f''(a) = ∞');
INSERT INTO Translation VALUES('2a58e6d8-da1a-435d-8420-1060fad835fa','f''(a) = 1','f''(a) = 1');
INSERT INTO Translation VALUES('4216ae23-9760-4c14-8a48-c7693fd7c27c','Calculate f''(1) for f(x) = 2x³ - 3x + 1 using the limit definition.','חשב f''(1) עבור f(x) = 2x³ - 3x + 1 באמצעות הגדרת הגבול.');
INSERT INTO Translation VALUES('3d5dc02c-54af-43b5-84c2-385dac36fbcb','What is a critical point of a function?','מהי נקודה קריטית של פונקציה?');
INSERT INTO Translation VALUES('23491faa-7b74-4969-909d-4779fdb08e70','A point where f''(x) = 0 or f''(x) does not exist','נקודה שבה f''(x) = 0 או f''(x) לא קיימת');
INSERT INTO Translation VALUES('0218a11d-52d1-49ae-9f1a-8e9a3f5144b7','A point where f(x) = 0','נקודה שבה f(x) = 0');
INSERT INTO Translation VALUES('5b05067a-921b-4dfa-bf6e-8bdb2619c25c','A point where f(x) is undefined','נקודה שבה f(x) לא מוגדרת');
INSERT INTO Translation VALUES('0ffdb967-d41c-4b09-9fad-b8d7070d5cd2','A point where f(x) has a discontinuity','נקודה שבה ל-f(x) יש אי-רציפות');
INSERT INTO Translation VALUES('d9e9752a-0022-4427-90c4-d01881041d8e','What is the difference between a local maximum and a global maximum?','מה ההבדל בין מקסימום מקומי למקסימום גלובלי?');
INSERT INTO Translation VALUES('c1b7ead4-cfd3-4dc2-98a4-3438d7e3e301','Local maximum is highest in a neighborhood, global maximum is highest everywhere','מקסימום מקומי הוא הגבוה ביותר בסביבה, מקסימום גלובלי הוא הגבוה ביותר בכל מקום');
INSERT INTO Translation VALUES('8f3198b9-bd05-47dd-ad22-71480826bb79','They are the same thing','הם אותו דבר');
INSERT INTO Translation VALUES('c9fcfa87-2ce6-4bb9-b003-bf53f043bc8d','Local maximum occurs at endpoints, global maximum occurs inside the domain','מקסימום מקומי מתרחש בנקודות קצה, מקסימום גלובלי מתרחש בתוך התחום');
INSERT INTO Translation VALUES('1e79c30c-9e9c-4b1c-b97d-cc2433b40feb','Global maximum is always smaller than local maximum','מקסימום גלובלי תמיד קטן ממקסימום מקומי');
INSERT INTO Translation VALUES('4928c376-45db-4aa9-bd91-d5a6a85dc9be','According to Fermat''s theorem, if f has a local extremum at an interior point c, then what must be true?','לפי משפט פרמה, אם ל-f יש קיצון מקומי בנקודה פנימית c, אז מה חייב להיות נכון?');
INSERT INTO Translation VALUES('78d633cf-e640-4f1d-bbb5-07b12583b766','f''(c) = 0 or f''(c) does not exist','f''(c) = 0 או f''(c) לא קיימת');
INSERT INTO Translation VALUES('c99a031e-6d38-47d2-9399-44df25cb011f','f(c) = 0','f(c) = 0');
INSERT INTO Translation VALUES('24cdb493-2ca1-4b50-88ba-6aeb35666180','f''(c) > 0','f''(c) > 0');
INSERT INTO Translation VALUES('917145b5-35b8-4152-9c1f-3afd0eb564ae','f is continuous at c','f רציפה ב-c');
INSERT INTO Translation VALUES('505707b4-16f9-483d-9a61-c04117d01000','Can a function have a local extremum at a point where the derivative doesn''t exist?','האם פונקציה יכולה להיות בעלת קיצון מקומי בנקודה שבה הנגזרת לא קיימת?');
INSERT INTO Translation VALUES('9b83a40d-6eac-4925-9848-f6a4fd9b846e','What does the Extreme Value Theorem state about continuous functions on closed intervals?','מה קובע משפט ערכי הקיצון על פונקציות רציפות בקטעים סגורים?');
INSERT INTO Translation VALUES('c26f5cb2-198e-4af8-9abc-d2049dad0052','They attain their maximum and minimum values','הן משיגות את ערכי המקסימום והמינימום שלהן');
INSERT INTO Translation VALUES('563f69b8-cc72-4aa3-8ed1-ce8d1677d4b5','They have no extrema','אין להן קיצוני ערכים');
INSERT INTO Translation VALUES('ce743c1c-004c-4a18-bef4-10de9ed39619','They are always differentiable','הן תמיד גזירות');
INSERT INTO Translation VALUES('bd602bb0-3d27-438b-a569-f32429bcc26f','They have infinitely many extrema','יש להן אינסוף קיצוני ערכים');
INSERT INTO Translation VALUES('8aed5aa2-7ebb-44a1-a0e4-4a013ca3223a','If f''(c) = 0, does this guarantee that f has a local extremum at x = c?','אם f''(c) = 0, האם זה מבטיח של-f יש קיצון מקומי ב-x = c?');
INSERT INTO Translation VALUES('84812ed1-5112-4655-b4f0-fac022b46b01','For f(x) = x³, what can we say about the critical point at x = 0?','עבור f(x) = x³, מה אנו יכולים לומר על הנקודה הקריטית ב-x = 0?');
INSERT INTO Translation VALUES('989379b7-dd91-4979-8e5b-ca7b927052a2','It''s an inflection point, not an extremum','זו נקודת פיתול, לא קיצון');
INSERT INTO Translation VALUES('f6a4dca5-2477-4936-adf7-1d784f920539','It''s a local maximum','זה מקסימום מקומי');
INSERT INTO Translation VALUES('e61c4e67-35d2-42e0-b85a-69d6be0ee2e1','It''s a local minimum','זה מינימום מקומי');
INSERT INTO Translation VALUES('a23b9dd3-773f-4c29-85c9-630c88cc0be8','It''s both a maximum and minimum','זה גם מקסימום וגם מינימום');
INSERT INTO Translation VALUES('bd593f29-c6c1-430a-9f8c-62ad9ad2264f','What is the definition of a local minimum at point c?','מהי ההגדרה של מינימום מקומי בנקודה c?');
INSERT INTO Translation VALUES('568d2bda-1307-4ae5-b509-f8d2b3c751b4','f(c) ≤ f(x) for all x in some neighborhood of c','f(c) ≤ f(x) עבור כל x באיזושהי סביבה של c');
INSERT INTO Translation VALUES('2fd8902e-6060-453d-8850-4628307f8b0e','f(c) ≥ f(x) for all x in some neighborhood of c','f(c) ≥ f(x) עבור כל x באיזושהי סביבה של c');
INSERT INTO Translation VALUES('6818e06b-de2e-4b3e-9733-92b0d0bec9fb','f(c) = 0','f(c) = 0');
INSERT INTO Translation VALUES('6bce26f9-ead9-4a08-9ddf-ea1935228f44','f''(c) < 0','f''(c) < 0');
INSERT INTO Translation VALUES('de71b638-cbae-4e18-ad48-845d55e20537','Can extrema occur at the endpoints of a closed interval?','האם קיצוני ערכים יכולים להתרחש בנקודות הקצה של קטע סגור?');
INSERT INTO Translation VALUES('96d9eb02-6ebf-4b06-8e80-3f31b7c8d62e','How many critical points does f(x) = x² - 4x + 3 have?','כמה נקודות קריטיות יש ל-f(x) = x² - 4x + 3?');
INSERT INTO Translation VALUES('30689b3a-e596-4b1e-aa72-2a426daab962','What is the critical point of f(x) = x² - 6x + 5?','מהי הנקודה הקריטית של f(x) = x² - 6x + 5?');
INSERT INTO Translation VALUES('fa9caae8-7077-4782-bd78-9c6fe5e0dddb','Which test can be used to determine if a critical point is a local extremum?','איזה מבחן ניתן להשתמש בו כדי לקבוע אם נקודה קריטית היא קיצון מקומי?');
INSERT INTO Translation VALUES('6636a8aa-ad4a-478b-b2b1-1f56c0542e2b','Second derivative test','מבחן הנגזרת השנייה');
INSERT INTO Translation VALUES('1dd68433-0d44-4a73-9cee-0a28adda850f','Intermediate value theorem','משפט ערך הביניים');
INSERT INTO Translation VALUES('2b5baa94-be02-49ff-89e4-8657ced0c1cc','Mean value theorem','משפט ערך הממוצע');
INSERT INTO Translation VALUES('136fa799-0372-4822-9baa-ca54b23f6265','Fundamental theorem of calculus','המשפט הבסיסי של החשבון הדיפרנציאלי');
INSERT INTO Translation VALUES('b6f78d1d-ec8e-4a3d-b775-5059ee7480a5','A function can have both a local maximum and minimum at the same point.','פונקציה יכולה להיות בעלת גם מקסימום מקומי וגם מינימום מקומי באותה נקודה.');
INSERT INTO Translation VALUES('644baeec-7dde-4f6f-8f3d-370b5bbb99a0','For f(x) = |x|, where does the global minimum occur?','עבור f(x) = |x|, איפה מתרחש המינימום הגלובלי?');
INSERT INTO Translation VALUES('cb5180c1-9103-4723-a74b-4e60a5064adb','What type of extremum does f(x) = -x² + 4x - 3 have at its critical point?','איזה סוג של קיצון יש ל-f(x) = -x² + 4x - 3 בנקודה הקריטית שלה?');
