INSERT INTO Translation VALUES('375d244a-5bb7-4f36-871e-e222991807ea','Local minimum','מינימום מקומי');
INSERT INTO Translation VALUES('34663249-59ee-427a-aec7-1ab0c5c5096b','Inflection point','נקודת פיתול');
