INSERT INTO Translation VALUES('0ac95883-ff04-47cd-8bb7-d8843712e96e','If f is continuous on [a,b], then f must have at least one global maximum and one global minimum on this interval.','אם f רציפה על [a,b], אז ל-f חייב להיות לפחות מקסימום גלובלי אחד ומינימום גלובלי אחד על הקטע הזה.');
INSERT INTO Translation VALUES('65c88e8c-8b76-4df7-9046-f4e2a9417cb2','What is the relationship between critical points and extrema?','מה הקשר בין נקודות קריטיות לקיצוני ערכים?');
INSERT INTO Translation VALUES('74fd83e5-2a8a-4e63-834b-1d6a0e056914','Local extrema can only occur at critical points or endpoints','קיצוני ערכים מקומיים יכולים להתרחש רק בנקודות קריטיות או בנקודות קצה');
INSERT INTO Translation VALUES('8172f4dd-b350-460a-ad37-969160a06bac','All critical points are extrema','כל הנקודות הקריטיות הן קיצוני ערכים');
INSERT INTO Translation VALUES('00984273-220b-4aa4-a97a-e87e639d6530','Extrema never occur at critical points','קיצוני ערכים אף פעם לא מתרחשים בנקודות קריטיות');
INSERT INTO Translation VALUES('9ad147cd-da58-4e2a-b904-e6c13ef26b80','Critical points and extrema are unrelated','נקודות קריטיות וקיצוני ערכים לא קשורים');
