INSERT INTO Translation VALUES('be226cb9-1436-428f-85a9-09a208390dbc','What is necessary for a point to be a global extremum?','מה נדרש כדי שנקודה תהיה קיצון גלובלי?');
INSERT INTO Translation VALUES('9e6e8917-697f-4aaa-8a72-a2669f424a71','The function value must be the highest or lowest over the entire domain','ערך הפונקציה חייב להיות הגבוה ביותר או הנמוך ביותר על כל התחום');
INSERT INTO Translation VALUES('4ff526f1-2019-48aa-b81b-3ab0e6ef3423','The derivative must equal zero','הנגזרת חייבת להיות שווה לאפס');
INSERT INTO Translation VALUES('ef60b2a4-2216-464e-a25c-56a0b51c923a','The point must be in the interior of the domain','הנקודה חייבת להיות בחלק הפנימי של התחום');
INSERT INTO Translation VALUES('ca0e8888-4494-4631-b402-8d9010e229e7','The second derivative must be positive','הנגזרת השנייה חייבת להיות חיובית');
