INSERT INTO Translation VALUES('34639430-2251-400d-aa24-02f18efeecb0','It applies to continuous functions on closed, bounded intervals','הוא חל על פונקציות רציפות בקטעים סגורים וחסומים');
INSERT INTO Translation VALUES('8f454b08-6d46-4ffe-a31a-c27f560694b7','It applies to all functions on any interval','הוא חל על כל הפונקציות בכל קטע');
