INSERT INTO Translation VALUES('ae6dacbb-4213-4c6d-a9d1-0d99de5073b6','It guarantees that extrema occur only at critical points','הוא מבטיח שקיצוני ערכים מתרחשים רק בנקודות קריטיות');
